(1, 'iqxt14jgz2', 'ILGA YULIAN', 'LOKASI DAN LEGALITAS PERUSAHAAN', 'ilga.putra15@gmail.com', 'selamat malam bapak/ibuk.\r\n\r\nperkenalkan saya ilga yulian putra desti, saya ingin menanyakan mengenai lokasi dan legalitas perusahaan.\r\n\r\n1. Lokasi asal saya di padang tetapi sekarang saya berada di jakarta, apakah saya bisa untuk mengikuti program inkubasi yang di adakan oleh lipi? apakah perserta yang bisa mengikuti program inkubasi hanya dari wilayah Bogor (kota/kab), Depok, Tangerang Selatan dan Bandung? \r\n2. saya memiliki ide untuk sebuah startup digital di bagian Internet of Thing, tetapi saya belum memliki legalitas perusahaan, karena saya masih dalam tahapan rintisan, apakah saya bisa ikut dalam program inkubasi walau belum memiliki legalitas perusahaan?\r\n\r\nterimakasih banyak atas perhatiannya bapak/ibuk', 1, '2017-09-14 23:42:44', '2017-09-15 03:43:30'),
(2, '1urfaphith', 'NURHUMA', 'BERTANYA', 'chiccinurhuma@gmail.com', 'sudah daftar tetapi notofikasi warna hijau belum muncul', 1, '2017-09-17 16:45:27', '2017-09-17 16:45:27');
