INSERT INTO `smit_incubation_selection` (`id`, `uniquecode`, `year`, `setting_id`, `user_id`, `companion_id`, `username`, `name`, `event_title`, `event_desc`, `category`, `step`, `score`, `average_score`, `status`, `steptwo`, `scoretwo`, `average_scoretwo`, `statustwo`, `datecreated`, `datemodified`, `view`) VALUES
(1, 'p1szrs2xda', 2017, 2, 137, 0, 'priyo7', 'Priyo Yantyo', 'Pembangunan fasilitas perikanan di Papua Barat den', 'Tujuan: Pengembangan pemanfaatan energy surya untuk mendorong kegiatan ekonomi di daerah 3T\r\nLatar belakang: potensi perikanan Indonesia yang besar tidak sebanding dengan nilai ekonomi yang diperoleh, karena hasil tangkapan nelayan sangat bergantung dengan proses pendinginan karena fasilitas pendinginan yang terbatas terutama di daerah 3T.', 'lingkungan', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-08 09:51:36', '2017-09-08 09:57:09', 1),
(2, 're12g2hygx', 2017, 2, 138, 0, 'kusumaputri', 'Kusumaputri', 'Pengolahan limbah sagu', 'Pengolahan limbah sagu _ contoh saja', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-08 11:36:27', '2017-09-15 11:21:03', 1),
(3, 's7i91ysqe3', 2017, 2, 169, 0, 'arindaho', 'Rinda Hedwig', 'Lemari Penyimpan Pintar yang Dapat Berkomunikasi d', 'Membuat modul pintar yang dapat diinstalasikan ke peralatan rumah tangga seperti kulkas, lemari penyimpan, dan meja makan dengan tujuan membantu pengguna dalam memonitor ketersediaan bahan pangan, menentukan resep masakan sesuai ketersediaan bahan pangan, dan membantu mengendalikan asupan kalori pengguna setiap harinya.', 'elektronika_informasi_komunikasi', 1, 240, 60, 1, 0, 0, 0, 0, '2017-09-15 10:57:41', '2017-09-15 11:22:54', 1),
(4, 'dlg8xkifng', 2017, 2, 199, 0, 'urip83', 'Urip Perwitasari', 'PRODUKSI ENZIM SERBUK GLUKOAMILASE MELALUI FERMENT', 'Kegiatan ini memanfaatkan limbah kulit singkong sebagai substrat dalam memproduksi enzim serbuk glukoamilase. Enzim glukoamilase dimanfaatkan untuk mendegradasi pati menjadi gula sederhana. Riset ini bertujuan untuk memproduksi enzim serbuk glukoamilase sebanyak 5000 g, dengan sasaran optimasi media padat untuk meningkatkan aktivitas enzim glukoamilase.', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-15 16:39:33', '2017-09-15 17:06:45', 1),
(5, 'js9camn5ky', 2017, 2, 14, 0, 'rajani', 'Ahmad Rajani', 'Pengembangan Produk Alat Penerangan Multifungsi Un', 'Kegiatan ini merupakan kelanjutan dan pengembangan dari Kegiatan Pra Inkubasi Alat Penerangan Multifungsi pada tahun 2017. Kegiatan Pra Inkubasi Alat Penerangan Multifungsi merupakan kerjasama P2 Telimek-LIPI  dengan CV. Intech Manufaktur yang difasilitasi Pusinov - LIPI dengan keluaran 250 buah alat penerangan multifungsi. Pada kegiatan Pra Inkubasi sudah menghasilkan produk dengan baik, namun pada saat dilakukan survey lapangan, memperoleh masukan dari konsumen bahwa bentuk desain casing kurang menarik dan harganya mahal, sehingga perlu untuk dilakukan penyempurnaan produk. \r\nPada kegiatan inkubasi ini akan dilakukan modifikasi pada desain casing dan optimasi fitur produk lampu penerangan multifungsi yang telah di produksi pra inkubasi. Modifikasi desain casing produk ini bertujuan agar desain casing lampu multifungsi yang baru lebih menarik. Desain casing lampu penerangan multifungsi yang baru akan menggunakan moulding, dengan tujuan dapat menekan biaya produksi apabila diproduksi massal dan CV. Intech dalam hal ini sebagai mitra dapat memproduksi secara mandiri.  Beberapa fitur yang ada pada lampu multifungsi tersebut jarang digunakan konsumen, sehingga perlu dilakukan modifikasi, agar fitur-fitur yang ada pada produk tersebut sesuai dengan kebutuhan konsumen. Perubahan fitur tersebut diharapkan dapat menurunkan biaya produksi', 'elektronika_informasi_komunikasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-15 18:15:16', '2017-09-15 18:20:51', 1),
(6, '3vr1c7q3ls', 2017, 2, 147, 0, 'putrafajaralam', 'Putra Fajar Alam', 'Aplikasi Sapi Indukan : Implementasi Internet of T', 'Sesuai data Kementerian Pertanian, hingga tahun 2013 dari 1.500 hingga 2.000 perusahaan sawit, hanya ada 5 perusahaan yang mengikuti program integrasi sapi sawit [3]. Salah satu permasalahan yang ditemukan berdasarkan survei di lapangan adalah kesulitan pengelolaan data serta proses pemantauan sapi yang dilepas di kebun sawit.\r\nAtas dasar permasalahan tersebut, PT. Solusi Hijau Indonesia mencoba untuk membuat sebuah solusi berupa Aplikasi Sapi Indukan yang bertujuan untuk mendukung kegiatan operasional peternakan sapi kebun sawit di seluruh Indonesia. Aplikasi Sapi Indukan mengintegrasikan proses pengelolaan peternakan sapi kebun sawit dengan mengoptimalkan penggunaan teknologi perangkat lunak, perangkat keras serta teknologi Internet of Things (IoT). \r\nPada Aplikasi Sapi Indukan, IoT diterapkan berupa penerapan teknologi Long Range RFID yang digunakan sebagai ear tag pada setiap ekor sapi dan di deteksi keberadaannya oleh sensor yang diletakkan di area kandang sapi dan kebun sawit. Data tersebut di transmisikan melalui internet ke server pusat dan yang di visualisasikan ke dalam aplikasi mobile di smartphone yang bertujuan untuk memudahkan petugas di lapangan dalam melakukan proses pembaharuan data sapi di kendang dan pemantauan sapi yang berada di area kebun sawit.', 'pangan_agroindustri', 1, 280, 70, 1, 0, 0, 0, 0, '2017-09-15 22:04:41', '2017-09-15 22:34:11', 1),
(8, 'quxullmc59', 2017, 2, 201, 0, 'athontowi', 'Ahmad Thontowi', 'Produksi Bioetanol dari Limbah Kulit Casava dengan', 'Kegiatan ini berfokus pada scaling-up produksi bioetanol dengan memanfaatkan limbah kulit casava, sakrifikasi enzim glukoamilase lokal, fermentasi ragi unggul lokal dan pemurnian produk bioatenaol hasil fermentasi.', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-16 08:52:51', '2017-09-16 17:36:47', 1),
(9, 'j1reelgmpg', 2017, 2, 191, 0, 'oka.adnyana', 'I Gede Oka Adnyana', 'PENINGKATAN PRODUKSI MINYAK ATSIRI CENGKEH (Eugeni', 'Tujuan dari kegiatan ini adalah untuk meningkatkan produksi minyak atsiri gagang cengkeh dan daun cengkeh, mengenalkan metode yang tepat dalam pembuatan minyak atsiri gagang cengkeh dan daun cengkeh. Sasaran yang ingin dicapai adalah berkembangnya UMKM yang memproduksi minyak atsiri gagang cengkeh dan daun cengkeh.\r\nDalam skala industri rumah tangga yang beroperasi selama 24 jam non-stop, hasil produksi belum dapat memenuhi permintaan pasar, yang umumnya para pengepul di Bali menjual produk minyak cengkeh dari Bali utara ke Jawa Timur. Data terbaru tentang besaran pasar minyak cengkeh dari skala home industry, sebagai berikut: 2 ketel penyulingan, beroperasi sebanyak 3 kali dalam 24 jam, kapasitas per ketel 500 kg bahan baku, dengan rendemen sekitar 2 – 3 %, maka dalam 24 jam dapat mengasilkan 60 – 90 kg minyak cengkeh berbahan dasar daun. Hasil produski tersebut secara langsung dapat diserap oleh pasar melalui pengepul.\r\nKeunggulan saat ini adalah permintaan yang cukup tinggi dari para pembeli, yakni perusahaan kecil, menengah, dan besar yang bergerak di bidang obat, pharmaceutical, dan makanan. Kelemahan yang teridentifikasi diantaranya produksi tidak berkelanjutan karena keterbatasan bahan baku, inefisiensi proses produksi, dan harga jual yang rendah karena produk dijual ke pengepul.', 'kesehatan_farmasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-16 15:31:07', '2017-09-18 09:35:17', 1),
(10, 'xyhlnutcbb', 2017, 2, 191, 0, 'oka.adnyana', 'I GEDE OKA ADNYANA', 'PENINGKATAN PRODUKSI MINYAK ATSIRI CENGKEH (Eugeni', 'Tujuan dari kegiatan ini adalah untuk meningkatkan produksi minyak atsiri gagang cengkeh dan daun cengkeh, mengenalkan metode yang tepat dalam pembuatan minyak atsiri gagang cengkeh dan daun cengkeh. Sasaran yang ingin dicapai adalah berkembangnya UMKM yang memproduksi minyak atsiri gagang cengkeh dan daun cengkeh.\r\nKeunggulan saat ini adalah permintaan yang cukup tinggi dari para pembeli, yakni perusahaan kecil, menengah, dan besar yang bergerak di bidang obat, pharmaceutical, dan makanan. Kelemahan yang teridentifikasi diantaranya produksi tidak berkelanjutan karena keterbatasan bahan baku, inefisiensi proses produksi, dan harga jual yang rendah karena produk dijual ke pengepul.  \r\nDalam skala industri rumah tangga yang beroperasi selama 24 jam non-stop, hasil produksi belum dapat memenuhi permintaan pasar, yang umumnya para pengepul di Bali menjual produk minyak cengkeh dari Bali utara ke Jawa Timur. Data terbaru tentang besaran pasar minyak cengkeh dari skala home industry, sebagai berikut: 2 ketel penyulingan, beroperasi sebanyak 3 kali dalam 24 jam, kapasitas per ketel 500 kg bahan baku, dengan rendemen sekitar 2 – 3 %, maka dalam 24 jam dapat mengasilkan 60 – 90 kg minyak cengkeh berbahan dasar daun. Hasil produksi tersebut secara langsung dapat diserap oleh pasar melalui pengepul.', 'kesehatan_farmasi', 1, 360, 90, 1, 0, 0, 0, 0, '2017-09-16 15:37:38', '2017-09-16 17:36:47', 1),
(11, '9w0aoedac2', 2017, 2, 227, 0, 'lelyrahmawaty', 'Lely Rahmawaty, STP, MP', 'Gula Aren dalam Kemasan', 'Usaha Agroindustri Produk Gula Aren dalam Kemasan Praktis dan Modern untuk memberikan kemudahan dan desain modern yang dapat diaplikasikan di berbagai acara dan kegiatan tanpa membutuhkan peralatan tambahan. Mamiliki citarasa khas coklat, produk organik alami dan baik untuk kesehatan (penderita diabetes dan kolesterol) dengan IG rendah (35). Memiliki potensi ekspor dan produk layak komersil.', 'pangan_agroindustri', 1, 240, 60, 1, 0, 0, 0, 0, '2017-09-16 15:53:00', '2017-09-16 17:36:47', 1),
(12, 'v2ph046cwi', 2017, 2, 141, 0, 'mawardi', 'Mawardi', 'unpamstore', 'UnpamStore merupakan Portal Informasi Jual Beli dan Layanan Pemasaran Civitas Akademika Universitas Pamulang.', 'elektronika_informasi_komunikasi', 1, 120, 30, 1, 0, 0, 0, 0, '2017-09-16 17:38:40', '2017-09-16 18:02:33', 1),
(13, 'za4szc7quh', 2017, 2, 175, 0, 'nunikania', 'Adi Arriansyah', 'Teknologi.id', 'Teknologi.id adalah Komunitas Pengembang Teknologi Indonesia (Stack Overflow Indonesia) yang bertujuan untuk menggali potensi pengembangan teknologi di Indonesia. Teknologi.id bermesinkan platform media dan forum komunitas online untuk menghubungkan pengembang teknologi dan desainer untuk dapat saling berbagi informasi mengenai permasalahan dalam pengembangan teknologi.\r\n\r\nPerusahaan / bisnis dapat memperoleh manfaat dari platform Teknologi.id. Teknologi dapat memberikan informasi tentang para pengembang teknologi dan desainer yang aktif berkontribusi dalam platform, sehingga Teknologi.id juga berperan sebagai media penghubung karir di dunia profesional.\r\n\r\nUntuk mengetahui produk kami lebih jelas, silahkan kunjungi www.teknologi.id', 'elektronika_informasi_komunikasi', 1, 180, 45, 1, 0, 0, 0, 0, '2017-09-16 20:28:04', '2017-09-16 22:32:44', 1),
(14, 'c9vq64lnpu', 2017, 2, 152, 0, 'rayafamily', 'MUHAMAD TIRTA', 'SYSTEM TEKNOLOGI PENDATAAN DAN PENINGKATAN UMKM DE', 'SYSTEM TEKNOLOGI PENDATAAN DAN PENINGKATAN UMKM DENGAN POLA ASSESMENT (SCOPE) ini bertujuan untuk meningkatkan akurasi dan validasi data UMKM sebagai bahan rujukan dalam pengambilan keputusan/kebijakan untuk memberdayakan pelaku UMKM dan Solusi Pemecahan Masalah UMKM yang selama ini belum terpecahkan. Metode assesment adalah sebuah metode menggabungkan Teknonogi IT dengan Test Psikologi untuk mengetahui sejauh apa masalah yang dihadapi oleh umkm yang kemudian akan dicarikan solusinya oleh dewan pakar. Dewan Pakar adalah Orang orang yang berkompeten di berbagai sektor usaha yang ada di umkm, seperti Bidang Industri Olahan, Pertanian, Peternakan, Jasa Dll', 'elektronika_informasi_komunikasi', 1, 70, 18, 1, 0, 0, 0, 0, '2017-09-16 22:55:39', '2017-09-16 23:32:58', 1),
(15, 'vekaprx0gp', 2017, 2, 243, 0, 'rifalipi', 'Rifa Nurhayati', 'Inkubasi  Peningkatan Kapasitas Produksi Minuman C', 'program Inkubasi Teknologi Pusat Inovasi LIPI Tahun 2018 ini bertujuan untuk melakukan alih teknologi diversifikasi produk berbasis cokelat lokal pada Griya Cokelat Nglanggeran di Kabupaten Gunungkidul DIY, diantaranya optimasi peningkatan kapasitas produksi minuman cokelat instan Chocomix, diversifikasi produk dark chocolate dan couverture chocolate.\r\nSasaran yang akan dicapai dari kegiatan ini adalah:\r\n1.	Terwujudnya peningkatan kapasitas produksi dan perbaikan kemasan minuman cokelat instan Chocomix di Griya Cokelat Nglanggeran\r\n2.	Terjadi alih teknologi diversifikasi produk berbasis cokelat lokal di Griya Cokelat Nglanggeran\r\n3.	Terciptanya peningkatan kapasitas dan kompetensi wirausahawan baru dengan diversifikasi produk  berbasis cokelat di Griya Cokelat Nglanggeran lewat program Inkubasi Teknologi Pusat Inovasi LIPI', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 14:05:40', '2017-09-18 09:35:17', 1),
(16, '3utdorohg7', 2017, 2, 243, 0, 'rifalipi', 'Rifa Nurhayati', 'Inkubasi  Peningkatan Kapasitas Produksi Minuman C', 'program Inkubasi Teknologi Pusat Inovasi LIPI Tahun 2018 ini bertujuan untuk melakukan alih teknologi diversifikasi produk berbasis cokelat lokal pada Griya Cokelat Nglanggeran di Kabupaten Gunungkidul DIY, diantaranya optimasi peningkatan kapasitas produksi minuman cokelat instan Chocomix, diversifikasi produk dark chocolate dan couverture chocolate.\r\nSasaran yang akan dicapai dari kegiatan ini adalah:\r\n1.	Terwujudnya peningkatan kapasitas produksi dan perbaikan kemasan minuman cokelat instan Chocomix di Griya Cokelat Nglanggeran\r\n2.	Terjadi alih teknologi diversifikasi produk berbasis cokelat lokal di Griya Cokelat Nglanggeran\r\n3.	Terciptanya peningkatan kapasitas dan kompetensi wirausahawan baru dengan diversifikasi produk  berbasis cokelat di Griya Cokelat Nglanggeran lewat program Inkubasi Teknologi Pusat Inovasi LIPI', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 14:06:10', '2017-09-17 14:26:15', 1),
(17, 'yj7jrqy9jg', 2017, 2, 241, 0, 'triyanisumiati', 'Triyani Sumiati', 'Potensi ekstrak kulit dan bonggol nanas (Ananas co', 'Enzim bromelin yang terkandung dalam kulit nanas dapat dikembangkan sebagai sediaan obat kumur. Hal ini dikarenakan enzim bromelin dapat menghambat pertumbuhan bakteri Streptococcus sanguinis yang dapat menyebabkan pembentukan plak gigi. Produk yang akan dibuat adalah sediaan obat kumur. Obat kumur mempunyai fungsi sama seperti pasta gigi yang dapat dikategorikan sebagai kosmetik, terapeutik, atau keduanya. Obat kumur dapat digunakan untuk membunuh bakteri, sebagai penyegar, menghilangkan bau tak sedap, dan memberikan efek terapeutik dengan meringankan infeksi atau mencegah karies (Sagarin dan Gershon, 1972). Keefektifan obat kumur yang lain adalah kemampuannya menjangkau tempat yang paling sulit dibersihkan dengan sikat gigi dan dapat mencegah pembentukan plak, tetapi penggunaannya tidak bisa sebagai substitusi sikat gigi (Claffey, 2003).\r\nInovasi dari penelitian ini adalah akan dibuat sediaan obat kumur dari bahan limbah buah nanas yaitu kulit nanas dan bonggo nanas yang mempunyai potensi sebagai antiplak karena terdapat kandungan enzim bromelin. Bahan baku yang digunakan adalah limbah yang berasal dari perusahaan pengolah buah nanas yang berarti kegiatan ini memanfaatkan limbah organik yang dihasilkan. Kegiatan ini juga akan menghasilkan produk obat kumur herbal yang mempunyai efek terapeutik yang baik dan mempunyai efek samping yang minimal (rendah)  dengan harga yang kompetitif. Produk obat kumur ini  dapat dibuat melalui adanya kerjasama antara institusi pendidikan dengan Perusahaan Industri Rumah Tangga/UKM. Melalui kegiatan inovasi pra inkubasi ini, diharapkan produk obat kumur yang dihasilkan dapat dikembangkan baik kualitas  maupun  kuantitasnya dengan melakukan kerjasama dengan industri besar.', 'kesehatan_farmasi', 1, 190, 48, 1, 0, 0, 0, 0, '2017-09-17 14:27:07', '2017-09-17 14:56:12', 1),
(18, '9zbrs79d7p', 2017, 2, 246, 0, 'muhakkateru', 'Muhakka, S.Pt., M.Si', 'Aplikasi Teknologi Amofer Rumput Rawa Sebagai Paka', 'Pakan merupakan aspek penting dalam pengembangan ternak suatu daerah, karena pakan memberikan terbesar yakni 75% dari total biaya produksi. Kualitas dan kuantitas pakanpun menjadi ujung tombak keberhasilan dalam usaha peternakan karena hasil karkas berkualitas dan memiliki kuantitas optimal salah satunya ditentukan pakan. Sebesar apapun potensi genetik tanpa memperoleh pasokan pakan berkualitas dan kuantitas yang cukup maka tidak akan menampilkan potensi genetiknya. Namun apabila melihat fakta yang ada upaya pemenuhan pakan hijauan sangat sulit dipenuhi, karena sebagian besar lahan yang dimiliki oleh petani/peternak adalah rawa, selain lahan rawa tanaman pangan menjadi tanaman utama yang ditanami pada lahan yang dimilki. \r\nUapaya pemenuhan pakan bagi ternak kerbau pampangan sangat sulit dipenuhi apabila hanya mengandalkan hijauan rawa yang ada disekitar desa tersebut. Pada musim penghujan jumlah hijauan cukup melimpah, namun sebaliknya pada musim kemarau  jumlah hijauan yang tersedia sangat sedikit bahkan tidak tersedia, tentu saja permasalahan tersebut menjadi dilema yang berkepanjangan bagi Kelompok Peternak “SINAR RAMBUTAN” di Desa Rambutan apabila tidak diatasi secara fokus dan konsisten. Salah satu permasalahan utama dalam pengembangan produksi ternak kerbau pampangan tersebut adalah sulitnya memenuhi ketersediaan pakan secara berkesinambungan baik mutu maupun jumlahnya. Hal ini berakibat  kurang berkembangkannya tingkat produksi dan produktivitas. Peternak hanya mengandalkan pakan alami yang tumbuh di padang penggembalaan yang populasinya  di  Desa Rambutan saat ini  sudah  mulai menurun, terutama yang palatable (disukai) oleh ternak kerbau pampangan. Berkurangnya jenis pakan yang disukai oleh ternak kerbau pampangan diduga karena penggembalaan yang over grazing. Ternak kerbau pampangan dalam kondisi kekurangan pakan terutama pada musim kemarau, akan memakan jenis tumbuhan yang tidak disukai, sehingga berpengaruh pada pertumbuhannya. Ternak kerbau pampangan akan menjadi kurus dan mati akibat kekurangan pakan. \r\nUntuk mengatasi permasalahan kekurangan pakan kerbau pampangan di Kelompok Peternak SINAR RAMBUTAN adalah dengan cara pemanfaatan aplikasi teknologi Amofer rumput rawa yang ada di daerah-daerah rawa di Sumatera Selatan dengan menggunakan inokulan probiotik lokal dari silase rumput rawa. Amofer rumput rawa tersebut diyakini tersedia sepanjang tahun (berkesinambungan) dan kandungan nilai nutrisinya sesuai dengan yang dibutuhkan kerbau pampangan, sehingga produktivitas kerbau pampangan meningkat.', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 15:14:29', '2017-09-18 09:35:17', 1),
(19, 'q6pfg2g0ec', 2017, 2, 246, 0, 'muhakkateru', 'Muhakka, S.Pt., M.Si', 'Aplikasi Teknologi Amofer Rumput Rawa Sebagai Paka', 'Pakan merupakan aspek penting dalam pengembangan ternak suatu daerah, karena pakan memberikan terbesar yakni 75% dari total biaya produksi. Kualitas dan kuantitas pakanpun menjadi ujung tombak keberhasilan dalam usaha peternakan karena hasil karkas berkualitas dan memiliki kuantitas optimal salah satunya ditentukan pakan. Sebesar apapun potensi genetik tanpa memperoleh pasokan pakan berkualitas dan kuantitas yang cukup maka tidak akan menampilkan potensi genetiknya. Namun apabila melihat fakta yang ada upaya pemenuhan pakan hijauan sangat sulit dipenuhi, karena sebagian besar lahan yang dimiliki oleh petani/peternak adalah rawa, selain lahan rawa tanaman pangan menjadi tanaman utama yang ditanami pada lahan yang dimilki. \r\nUapaya pemenuhan pakan bagi ternak kerbau pampangan sangat sulit dipenuhi apabila hanya mengandalkan hijauan rawa yang ada disekitar desa tersebut. Pada musim penghujan jumlah hijauan cukup melimpah, namun sebaliknya pada musim kemarau  jumlah hijauan yang tersedia sangat sedikit bahkan tidak tersedia, tentu saja permasalahan tersebut menjadi dilema yang berkepanjangan bagi Kelompok Peternak “SINAR RAMBUTAN” di Desa Rambutan apabila tidak diatasi secara fokus dan konsisten. Salah satu permasalahan utama dalam pengembangan produksi ternak kerbau pampangan tersebut adalah sulitnya memenuhi ketersediaan pakan secara berkesinambungan baik mutu maupun jumlahnya. Hal ini berakibat  kurang berkembangkannya tingkat produksi dan produktivitas. Peternak hanya mengandalkan pakan alami yang tumbuh di padang penggembalaan yang populasinya  di  Desa Rambutan saat ini  sudah  mulai menurun, terutama yang palatable (disukai) oleh ternak kerbau pampangan. Berkurangnya jenis pakan yang disukai oleh ternak kerbau pampangan diduga karena penggembalaan yang over grazing. Ternak kerbau pampangan dalam kondisi kekurangan pakan terutama pada