n pakan terutama pada musim kemarau, akan memakan jenis tumbuhan yang tidak disukai, sehingga berpengaruh pada pertumbuhannya. Ternak kerbau pampangan akan menjadi kurus dan mati akibat kekurangan pakan. \r\nUntuk mengatasi permasalahan kekurangan pakan kerbau pampangan di Kelompok Peternak SINAR RAMBUTAN adalah dengan cara pemanfaatan aplikasi teknologi Amofer rumput rawa yang ada di daerah-daerah rawa di Sumatera Selatan dengan menggunakan inokulan probiotik lokal dari silase rumput rawa. Amofer rumput rawa tersebut diyakini tersedia sepanjang tahun (berkesinambungan) dan kandungan nilai nutrisinya sesuai dengan yang dibutuhkan kerbau pampangan, sehingga produktivitas kerbau pampangan meningkat.', 'pangan_agroindustri', 1, 210, 53, 1, 0, 0, 0, 0, '2017-09-17 15:26:52', '2017-09-18 09:35:17', 1),
(21, 'hp9j241bib', 2017, 2, 230, 0, 'muchamad.hartanto', 'Muchamad Hartanto', 'Standarisai  Pesawat Survei Tanpa Awak Untuk Bersa', 'Pemetaan Bergerak Satelit\r\n    Dengan memanfaatkan berbagai citra dari ASTER, ALOS, Landsat, atau Quickbird, citra satelit mencakup area yang luas dengan resolusi dan akurasi sub-meter, dan dapat diproses lebih lanjut berdasarkan pada kebutuhan Anda.\r\n\r\nSurvei UAV\r\n    Survei penginderaan jarak jauh yang canggih, memanfaatkan pemicu terbang dan pemotretan berpemandu GPS, memastikan data Anda bebas dari awan dengan akurasi kurang dari 10 cm dan tersedia kapan saja. Rumah kita yang dibangun AUV mampu menjangkau 100ha dalam satu penerbangan (sekitar 1 jam) dan dengan turnaroud misi cepat, ini bisa diulang beberapa kali dalam sehari.\r\n\r\nPenginderaan Jauh\r\n    Luas area, gambar banyak tujuan, bisa diandalkan adalah beberapa manfaat survei penginderaan jarak jauh. Berasal dari satelit yang mengorbit bumi atau dari UAV terbang rendah, masing-masing memiliki keuntungan sendiri untuk membantu Anda mendapatkan citra yang lebih besar, dan melaksanakan proyek dengan percaya diri.', 'elektronika_informasi_komunikasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 21:15:50', '2017-09-17 22:18:38', 1),
(22, 'pa1bdkvia0', 2017, 2, 230, 0, 'muchamad.hartanto', 'Muchamad Hartanto', 'Standarisai  Pesawat Survei Tanpa Awak Untuk Bersa', 'Pemetaan Bergerak Satelit\r\nDengan memanfaatkan berbagai citra dari ASTER, ALOS, Landsat, atau Quickbird, citra satelit mencakup area yang luas dengan resolusi dan akurasi sub-meter, dan dapat diproses lebih lanjut berdasarkan pada kebutuhan Anda.\r\n\r\nSurvei UAV\r\nSurvei penginderaan jarak jauh yang canggih, memanfaatkan pemicu terbang dan pemotretan berpemandu GPS, memastikan data Anda bebas dari awan dengan akurasi kurang dari 10 cm dan tersedia kapan saja. Rumah kita yang dibangun AUV mampu menjangkau 100ha dalam satu penerbangan (sekitar 1 jam) dan dengan turnaroud misi cepat, ini bisa diulang beberapa kali dalam sehari.\r\n\r\nPenginderaan Jauh\r\nLuas area, gambar banyak tujuan, bisa diandalkan adalah beberapa manfaat survei penginderaan jarak jauh. Berasal dari satelit yang mengorbit bumi atau dari UAV terbang rendah, masing-masing memiliki keuntungan sendiri untuk membantu Anda mendapatkan citra yang lebih besar, dan melaksanakan proyek dengan percaya diri.', 'elektronika_informasi_komunikasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 22:35:24', '2017-09-18 09:35:17', 1),
(23, '4y4l5ca6pw', 2017, 2, 230, 0, 'muchamad.hartanto', 'Muchamad Hartanto', 'Standarisai  Pesawat Survei Tanpa Awak Untuk Bersa', 'Pemetaan Bergerak Satelit\r\nDengan memanfaatkan berbagai citra dari ASTER, ALOS, Landsat, atau Quickbird, citra satelit mencakup area yang luas dengan resolusi dan akurasi sub-meter, dan dapat diproses lebih lanjut berdasarkan pada kebutuhan Anda.\r\n\r\nSurvei UAV\r\nSurvei penginderaan jarak jauh yang canggih, memanfaatkan pemicu terbang dan pemotretan berpemandu GPS, memastikan data Anda bebas dari awan dengan akurasi kurang dari 10 cm dan tersedia kapan saja. Rumah kita yang dibangun AUV mampu menjangkau 100ha dalam satu penerbangan (sekitar 1 jam) dan dengan turnaroud misi cepat, ini bisa diulang beberapa kali dalam sehari.\r\n\r\nPenginderaan Jauh\r\nLuas area, gambar banyak tujuan, bisa diandalkan adalah beberapa manfaat survei penginderaan jarak jauh. Berasal dari satelit yang mengorbit bumi atau dari UAV terbang rendah, masing-masing memiliki keuntungan sendiri untuk membantu Anda mendapatkan citra yang lebih besar, dan melaksanakan proyek dengan percaya diri.', 'elektronika_informasi_komunikasi', 1, 80, 20, 1, 0, 0, 0, 0, '2017-09-17 22:35:32', '2017-09-18 06:01:40', 1),
