(26, 'lcau5baq7o', 2017, 2, 263, 0, 'wahyudwianto', 'Wahyu Dwianto', 'PEMBUATAN SEPEDA DENGAN RANGKA KAYU', 'Mengembangkan teknologi pelengkungan kayu dan LVL ini menjadi sepeda dengan rangka kayu', 'material_maju', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 00:24:51', '2017-09-18 06:01:40', 1),
(27, 'i76lhcd6hz', 2017, 2, 120, 0, 'refarma', 'Humairoh Anahdi', 'Refarma, sebuah platform Redistribusi obat surplus', 'Refarma sebagai sebuat platform yang bekerja dengan menghubungkan antara pemilik obat surplus, Apotek,  penyedia layanan kesehatan dan Klien / pasien termasuk memperkuat  peran stakeholder farmasi dengan 3 misi Reduce, Re-distibusi obat surplus dan Re-maksimalisasi sistem serta penggunaan obat dimulai dari level rumah tangga. \r\n\r\nSering kita mendengar adanya obat yang tidak bisa ditebus karena harga yang sangat mahal atau resep obat yang tidak bisa ditemukan karena kelangkaan obat atau karena distribusi obat yang tidak merata yang mengharuskan kita berkeliling jauh dari tempat tinggal untuk mencari obat. Data menunjukkan ada 10% kekurangan obat yang tercatat pada jaminan kesehatan nasional (BPJS) diluar obat lainnya, padahal ada 47% Rumah Tangga menyimpan obat sisa dirumah (Riset Kesehatan Dasar, 2013) karena sembuh dari perawatan, pasien meninggal, swamedikasi atau memang menghentikan pengobatan. Bandingkan dengan total belanja obat di Indonesia  sebanyak 70 trilliun trilliun yang tercatat (Riset IMS 2016) yang 47 % - nya tersimpan di level rumah tangga dan 31,2 % nya masih bisa digunakan oleh orang lainnya. Obat tersebut sering dipergunakan tanpa pengawasan medis, disimpan lama atau tidak dipergunakan hingga akhirnya dibuang sembarangan karena ketiadaan fasilitas pembuangan limbah obat dari rumah tangga. Sementara sebagian obat yang dibuang disalahgunakan oleh oknum karena ketidaktahuan atau karena penanganan limbah yang tidak benar, padahal obat surplus tersebut sebagian masih bisa digunakan oleh orang yang membutuhkan dan sebagian lainnya harus ditangani pembuangannya dengan baik agar tidak disalahgunakan.', 'kesehatan_farmasi', 1, 160, 40, 1, 0, 0, 0, 0, '2017-09-18 00:57:47', '2017-09-18 06:01:40', 1),
(28, 'xw0g2ne3ne', 2017, 2, 167, 0, 'uti.sari', 'Uti Nilam Sari', 'uCare', 'uCare adalah integrator dan penyedia layanan kesehatan berbasis rumah (home health care) yang komprehensif. uCare membawa tenaga medis (dokter, perawat, fisioterapis, dll), peralatan medis, dan obat-obatan beserta  Ambulance ke rumah pasien. uCare akan memberikan pelayanan kesehatan komprehensif seperti di Rumah Sakit dimulai dari pengkajian, diagnosis, pengobatan, sampai dengan follow-up kondisi pasien, namun dilakukan di rumah.', 'kesehatan_farmasi', 1, 250, 63, 1, 0, 0, 0, 0, '2017-09-18 10:30:56', '2017-09-18 10:35:28', 1),
(29, 'yr24dr4c9v', 2017, 2, 195, 0, 'nadiafarahiya', 'Dr. Asep Nur Hidayat', 'Pengalengan Aneka Sambel Uleg', 'Membuat produk aneka sambal uleg yang diolah secara tradisional dan dikemas secara modern tanpa menggunakan bahan pengawet', 'pangan_agroindustri', 1, 250, 63, 1, 0, 0, 0, 0, '2017-09-18 10:41:43', '2017-09-18 10:53:09', 1),
(30, 'rfsp8ueds5', 2017, 2, 225, 0, 'liling', 'Liling Triyasmono', 'LOZENGES (TABLET HISAP) EKSTRAK AKAR PASAK BUMI BO', 'Produksi Lozenges (Tablet Hisap) Ekstrak Akar Pasak Bumi Borneo sebagai bentuk pengembangan dan diversifikasi Produk Akar Pasak Bumi yang dipasaran. Target Produk yang dihasilkan sebanyak 150 Tablet Hisap yang dikemas dalam blister tunggal dan dikemas sekunder dengan Karton maupun Tube sebanyak 5 Tablet Hisap per kemasan.', 'kesehatan_farmasi', 1, 260, 65, 1, 0, 0, 0, 0, '2017-09-18 10:46:34', '2017-09-18 10:53:09', 1),
(31, 'yfc6hc1cnu', 2017, 2, 258, 0, 'kiki_yulianto', 'Kiki Yulianto', 'PONIFERA-99 (Pupuk Organik Cair Aromatik)', 'Tujuan dari kegiatan ini adalah untuk memenuhi pasar, menciptakan lapangan pekerjaan dan memanfaatkan peluang untuk meningkatkan produktivitas Tanaman dengan menciptakan teknologi berupa Pupuk organik cair Berbasis Limbah beraroma buah. Selain itu, Menfaatkan buah-buahan yang sudah terbuang maupun buah yang belum optimal penggunaannya yang akan diolah menjadi pupuk cair beraroma buah sehingga memiliki nilai tambah dan mengatasi permasalahan limbah di Indonesia. Menjadikan  produk yang unggulan ramah lingkungan dan tidak merusak kandungan pada tanaman tersebut  serta memiliki aroma yang khas dan praktis dalam penggunaannya.', 'pangan_agroindustri', 1, 270, 68, 1, 0, 0, 0, 0, '2017-09-18 10:47:56', '2017-09-18 10:53:09', 1),
(32, 'wp1l0zwelw', 2017, 2, 252, 0, 'totokwianto', 'TOTOK WIANTO', 'Smart Water Automatic Portable Tenaga Sel Surya  U', 'Smartwater treatment protable merupakan produk inovasi dengan pengolahan air Menjadi Air Bersih Dan Air Siap minum dengan konsep produk yang portable. Produk Smartwater treatment protable memiliki dimensi yang minimalis yaitu 40 x 80 x 30 cm dilengkapi dengan sumber daya solar cell dan dapat disesuaikan dengan dimensi solar cell yang kompak dengan sistem tersebut, dengan sistem yang kompak maka produk ini akan di minati oleh masyarakat. Tenaga pompa berasal dari solar cell dengan daya 100 watt, serta didukung oleh sistem otomatis, sehingga dapat digunakan kapan saja. Untuk mendukung penggunaan malam hari disediakan produk tambahan dengan menggunakan aki untuk menjalankan pompa yang adal. Debit air bersih yang di hasilkan 1 – 5 Liter permenit sehingga dapat digunakan secara komunal, dengan harga berkisar antara 2,5 – 3,3 juta maka produk ini akan sangat kompetitif.', 'lingkungan', 1, 210, 53, 1, 0, 0, 0, 0, '2017-09-18 10:48:24', '2017-09-18 10:53:09', 0),
(33, '6fxpzp3gqh', 2017, 2, 134, 0, 'bhumirasa', 'Prof. Dr. Endang Sukara', 'MAKSIMALISASI PRODUKSI & SERTIFIKASI “CUKA BERAS B', 'Maksimalisasi produksi cuka beras organik, hingga sampai produk siap jual, dapat di terima pasar serta ditunjang dengan produk akhir yang sudah tersertifikasi.', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 10:57:12', '2017-09-18 10:58:26', 0),
(34, 'awo64a8jrx', 2017, 2, 20, 0, 'mlutfi321', 'Muhammad Lutfi', 'Pure Natural ,healthy drink asli Indonesia', 'pure natural memproduksi aneka minuman kesehatan ,untuk sekarang ini baru jenis jamu-jamuan dengan 7 inovasi produk', 'pangan_agroindustri', 1, 230, 58, 1, 0, 0, 0, 0, '2017-09-18 14:53:45', '2017-09-18 15:19:53', 0),
(35, 'nfdskjuk7o', 2017, 2, 209, 0, 'annisakusumaningrum', 'Annisa Kusumaningrum', 'INOVASI KEMASAN JENANG KETAN DI UKM KELOMPOK JENAN', '. Menerapkan teknologi pengemasan makanan khususnya untuk pengembangan kemasan jenang ketan khas Rongkop Kabupaten Gunungkidul yang lebih menarik sebagai salah satu oleh-oleh khas', 'pangan_agroindustri', 1, 0, 0, 0, 0, 0, 0, 0, '2017-09-18 18:36:07', '2017-09-18 18:36:07', 0),
(36, 'oyuvxnwzk1', 2017, 2, 190, 0, 'djonedas', '1,. Djoned Adhi Sardjito dan 2. Fahrozi Hamim', 'Pengembangan Bisnis Pupuk Hayati berbasis Limbah I', 'Bahan limbah industri minuman yang terdiri dari sisa bahan produksi dan bahan expired dikeluarkan isinya dan dicampur dan diaduk secara merata dan dimasukkan ke dalam Torn (penampung yang berkapasitas 10.000 liter.  Selanjutnya membuat bahan pereduksi yang terdiri dari :mengkudu, cengkeh, sereh, gula merah, jahe, kayu manis, dan nanas.  Bahan pereduksi diblender sampai halus (kecuali getah pepaya), kemudian direbus dengan panas antara 40-60 derajad dan sambil diaduk sampai muncul gelembung halus merata, dan dihentikan setelah terjadi aroma yang kuat,api dimatikan.  Bahan tersebut didinginkan, setelah dingin baru dimasukkan getah pepaya sambil diaduk. Kemudian masukkan kedalam botol yang berwarna gelap dengan volume 1 liter.  Bahan pereduksi yang telah jadi dicampur secara merata ke torn yang telah berisi limbah minuman,kemudian diaduk secara merata.  Setelah 3 hari campurkan 1 liter biostarter yang berisi bakteri pengurai dan aduk secara merata.  Tunggu selama satu bulan, baru bahan tersebut siap menjadi Pupuk Hayati cair.  Selanjutnya dipindah ketempat produksi dengan mobil tangki.  Selanjutnya diberi wadah botol yang berisi botol yang bersticker.  Pupuk hayati diuji kandungannya ke Balai Penelitian Tanah, Litbang Deptan.  Selanjutnya diuji efektivitasnya di lahan padi di lahan Sang Hyang Sri Sukamandi.  Disamping itu diuji efektivitasnya di peternakan sapi PT.Widodo Makmur Perkasa di Cikalong Kulon,Cianjur.', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 22:29:58', '2017-09-19 01:55:28', 0),
(37, '3l828oiawp', 2017, 2, 190, 0, 'djonedas', 'Ir. Djoned Adhi Sardjito', 'Pengembangan Pupuk Hayati Berbasis Limbah Industri', 'Usaha ini berawal dari usaha kecil dengan ketersediaan dana yang relatif kecil dengan memanfaatkan limbah industri minuman yang melimpah dan tidak bermanfaat, setelah ditambah dengan bahan pereduksi yang terdiri dari Mengkudu, getah pepaya, cengkeh, sereh, gula merah, jahe, kayu manis dan nanas dan bakteri pengurai akan menghasilkan Pupuk hayati yang bermanfaat dalam dekomposisi kotoran hewan yang merupakan masalah di bidang peternakan menjadi pupuk organik padat (pupuk kandang) yang dapat meningkatkan produksi tanaman dan memperbaiki sifat fisik dan kimia tanah dan dapat sebagai penolak/repellent Organisme Pengganggu Tanaman (OPT).  Bagi peternakan akan membantu program sanitasi kandang dan polusi bau kotoran hewan terhadap masyarakat sekitar kandang. Sebagai pupuk hayati dapat memperbaiki bahkan memulihkan sifat fisik dan kimia tanah (menyuburkan kembali tanah), dapat meningkatkan produksi tanaman padi dan tanaman lainnya, membantu penyediaan pangan yang sehat.  Dalam perkembangannya perlu bantuan dana untuk pengurusan hak paten dan ijin edarnya.  Perlu bantuan dana untuk peningkatan produksi serta pemasarannya sehingga dapat membantu program pemerintah dalam Program penyediaan produksi pangan yang sehat, membantu memulihkan tanah yang telah rusak, dan membantu dalam Pembangunan Pertanian yang berkelanjutan.', 'pangan_agroindustri', 1, 240, 60, 1, 0, 0, 0, 0, '2017-09-19 09:02:27', '2017-09-19 09:03:22', 0),
(38, 'p6gpr4vnw5', 2017, 2, 270, 0, 'dwiantowahyu', 'Didi Diarsa Adiana, S.Pd', 'PEMBUATAN SEPEDA DENGAN RANGKA KAYU', 'Pengembangan teknologi pelengkungan kayu dan LVL menjadi rangka kayu untuk sepeda sebagai alat transpotasi ramah lingkungan.', 'material_maju', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-19 09:59:41', '2017-09-19 10:07:25', 0),
(39, 'a2q44ctgie', 2017, 2, 281, 0, 'dididiarsa', 'Didi Diarsa Adiana, S.Pd', 'PEMBUATAN SEPEDA DENGAN RANGKA KAYU', 'Pengembangan teknologi pelengkungan kayu dan LVL menjadi sepeda dengan rangka kayu', 'material_maju', 1, 280, 70, 1, 0, 0, 0, 0, '2017-09-19 10:21:01', '2017-09-19 10:39:07', 0),
(40, 'e55dwe4mu8', 2017, 2, 290, 0, 'sprberiman', 'Acep Askari', 'Komersialisasi Produk Probiotik Sapi Perah dan Sap', 'Teknologi pembuatan probiotik merupakan teknologi sederhana namun mampu meningkatkan produktivitas sapi potong dan perah. Produk ini telah sesuai dengan Standar Nasional Indonesia (SNI) yang dibuktikan dengan adanya certificate of analysis (COA) dari laboratorium uji yang terakreditasi. Dengan adanya COA maka produk tersebut telah memenuhi persyaratan untuk dilakukan pengajuan ijin edar. Produk ini telah dilakukan pengujian lapangan di berbagai tempat, salah satunya adalah di daerah Kunak, Cibungbulang, Kabupaten Bogor yang merupakan sentra penghasil susu. Salah satu mitra yang menggunakan produk ini adalah Koperasi KPS Bogor, Koperasi Peternakan Mandiri Cisarua, Kelompok Mandiri SPR Kunak, Cibungbulang Bogor). Koperasi SPR Mandri Tegar Beriman Tertarik untuk mengembangkan produk probiotik menuju komersialisasi melalui skema transfer teknologi dari LIPI melalui lisensi paten terdaftar. Teknologi yang telah dikembangkan akan dilesensikan kepada Koperasi KPS Bogor, Kelompok Mandiri SPR Kunak, Cibungbulang Bogor). dan selama proses transfer teknologi akan dilakukan pendampingan. Pendampingan akan dilakukan meliputi proses perencanaan peralatan produksi, standarisasi sarana produksi hingga ke standarisasi bahan baku dan proses. Hal tersebut dilakukan untuk memastikan kualitas produk yang dihasilkan terjaga dalam setiap proses produksi. Mitra swasta yang akan bekerja sama memiliki jaringan yang baik dengan pemasok bahan baku maupun peternak yang berada di Jawa Barat dan sekitarnya. Hal tersebut menjadi kemudahan akses mitra yang bersangkutan untuk menjajaki berbagai jaringan komersialisasi.', 'pangan_agroindustri', 1, 400, 100, 1, 0, 0, 0, 0, '2017-09-22 15:17:06', '2017-09-22 15:24:53', 1);
