(1, '8v71fzpnt9', 'S/NEWS/001/INATEK/07/2017', 1, 'admin', 'ADMINISTRATOR', 'Tenant Inkubator LIPI Mendapatkan Seed Funding', 'Pusat Inovasi LIPI', '<p>Tenant Inkubator LIPI mendapatkan seed funding dari Kementerian Riset dan Teknologi dan Pendidikan Tinggi (Kemenristekdikti) melalui program Inkubasi Bisnis Teknologi tahun anggaran 2017. Ada tiga tenant yang telah berhasil mendapatkan seed funding tersebut. Tenant tersebut antara lain PT DNR International, CV Arrohmah dan CV Myco Pangan Indonesia</p>', '/var/www/inkubator/smitassets/backend/upload/news/1/1.jpg', 'jpg', '1', 'Thumbnail_1', 62.7, 1, 1, '2017-07-22 15:14:38', '2017-07-22 15:14:38'),
(2, 'bd6hw55ahm', 'Y/NEWS/002/INATEK/08/2017', 1, 'admin', 'ADMINISTRATOR', 'Monitoring Kegiatan Tenant di Inkubator LIPI', 'Pusat Inovasi LIPI', '<p>Pada tanggal 31 Juli hingga 2 Agustus lalu Pusat Inovasi LIPI melalukan monitoring kegiatan yang ada di LIPI. Kegiatan ini terdiri dari kegiatan STP, kegiatan Pra Inkubasi dan juga kegiatan dari tenant baik inwall maupun outwall.&nbsp;</p>', '/var/www/inkubator/smitassets/backend/upload/news/1/11.jpg', 'jpg', '11', 'Thumbnail_11', 48.3, 1, 1, '2017-08-03 11:51:15', '2017-08-03 11:51:15'),
(3, 'dvknxwdbue', 'H/NEWS/001/INATEK/09/2017', 1, 'admin', 'ADMINISTRATOR', 'PELUANG PENDANAAN BAGI UKM', 'Pusat Inovasi LIPI', '<p>Pusat Inovasi LIPI membuka peluang bagi pengusaha muda di wilayah Bogor (kota/kab), Depok, Tangerang Selatan dan Bandung untuk meningkatkan skala penjualannya dengan pendanaan dan bantuan ilmiah dari LIPI. Melalui mekanisme seleksi proposal, anda akan dapat pendanaan hingga Rp.150.000.000,- (seratus lima puluh juta) anda cukup mengajukan usulan kegiatan sesuai dengan format yang sudah ada. Kami tunggu proposal anda. <strong><a href=\"http://inovasi.lipi.go.id/inkubator/seleksi/inkubasi\">Klik di sini.</a></strong></p>', '/var/www/inkubator/smitassets/backend/upload/news/1/13.jpg', 'jpg', '13', 'Thumbnail_13', 112.48, 1, 1, '2017-09-08 14:32:43', '2017-09-08 16:34:16');
