(20, 'be_notif_incubation_success', '<p style=\"text-align:right\">Cibinong, {%curdate%}</p>\r\n\r\n<p>No &nbsp; &nbsp; &nbsp; : B-2349 /JI.4/UM.01/IX/2017</p>\r\n\r\n<p>Lamp &nbsp; : -</p>\r\n\r\n<p>Perihal : Pengumuman Hasil Seleksi Tahap I Kegiatan INKUBASI LIPI t.a {%selection_year%}</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Kepada Yth.</p>\r\n\r\n<p><strong>{%user_name%}</strong></p>\r\n\r\n<p>Di tempat</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Dengan Hormat,</p>\r\n\r\n<p>Menindaklanjuti hasil penjurian Seleksi Tahap I proposal Kegiatan INKUBASI LIPI tahun anggaran 2018 pada tanggal 19-22 September 2017, dengan ini kami informasikan bahwa proposal yang Saudara usulkan :</p>\r\n\r\n<p style=\"text-align:center\"><strong><span style=\"font-size:22px\">LOLOS TAHAP 1</span></strong></p>\r\n\r\n<p>Sehingga kami mengundang Saudara untuk hadir pada Seleksi Tahap II (Presentasi dan Wawancara) yang akan diselenggarakan pada :</p>\r\n\r\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"margin-left:50px; width:80%\">\r\n	<tbody>\r\n		<tr>\r\n			<td>Hari/Tanggal</td>\r\n			<td style=\"text-align:center; width:20px\">:</td>\r\n			<td>27 September 2016</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Agenda </td>\r\n			<td style=\"text-align:center; width:20px\">:</td>\r\n			<td>(akan dipublikasi tanggal 25 September 2017)</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"vertical-align:top\">Tempat</td>\r\n			<td style=\"text-align:center; vertical-align:top\">:</td>\r\n			<td style=\"vertical-align:top\">Ruang Rapat 208-209 Pusat Inovasi LIPI<br />\r\n			Jl. Raya Jakarta Bogor Km. 47 Cibinong, Bogor - Jawa Barat 16912</td>\r\n		</tr>\r\n\r\n	</tbody>\r\n</table>\r\n\r\n<p>Peserta wajib membawa hardcopy proposal dan RAB sebanyak 5 eksemplar, menyiapkan slide presentasi mengikuti format presentasi yang sudah ada, dokumen legalitas perusahaan, dan data diri. Format presentasi dapat diunduh melalui pranala <a href=\"http://inovasi.lipi.go.id/inkubator/berkasdigital\">berkasdigital</a>.</p>\r\n<p>Demikian yang dapat disampaikan, atas perhatiannya diucapkan terimakasih.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Tembusan Yth :</p>\r\n\r\n<ol>\r\n	<li>Deputi Bidang Jasa Ilmiah LIPI</li>\r\n</ol>'),
(21, 'be_notif_praincubation_confirm', '<p>Seleksi Pra Inkubasi Anda dengan judul <strong>{%event_title%}</strong> telah <strong>DIKONFIRMASI</strong>. Selanjutnya akan dilakukan proses penilaian.</p>\n\n<p>Silahkan login untuk melihat&nbsp;detail dan proses dari Seleksi Pra Inkubasi Anda</p>\n\n<p>&nbsp;</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p>Demikian informasi yang dapat disampaikan.&nbsp;Email ini dikirimkan secara otomatis oleh system, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</p>\n\n<p>&nbsp;</p>'),
(22, 'be_notif_praincubation_confirm2', '<p>Seleksi Pra Inkubasi Anda dengan judul <strong>{%event_title%}</strong> telah <strong>DIKONFIRMASI</strong>. Selanjutnya akan dilakukan proses penilaian pada tahap 2.</p>\n\n<p>Silahkan login untuk melihan detail dan proses dari Seleksi Pra Inkubasi Anda</p>\n\n<p>&nbsp;</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p>Demikian informasi yang dapat disampaikan.&nbsp;Email ini dikirimkan secara otomatis oleh system, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>'),
(23, 'be_notif_registration_user', '<p>Yth,&nbsp;<br />\nUsername&nbsp;<strong>{%username%}</strong></p>\n\n<p>Akun anda dengan username <strong>{%username%}</strong>&nbsp;telah <strong>{%status%}.</strong></p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p>&nbsp;</p>\n\n<p><small>Email ini dikirimkan secara otomatis oleh sistem, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</small></p>'),
(24, 'be_notif_registration_selection', '<p>Yth,&nbsp;<br />\nUsername&nbsp;<strong>{%username%}</strong></p>\n\n<p>Anda telah mendaftar untuk Seleksi Pra Inkubasi dengan judul <strong>{%event title%}</strong><br />\nSilahkan login untuk melihat&nbsp;detail dan proses dari usulan kegiatan Anda</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p><small>Email ini dikirimkan secara otomatis oleh sistem, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</small></p>'),
(25, 'be_notif_rated_selection', '<p>Yth,&nbsp;<br />\nUsername&nbsp;<strong>{%username%}</strong></p>\n\n<p>Proses penilaian dari kegiatan Anda telah selesai dinilai oleh para Juri.<br />\nSilahkan login untuk melihat&nbsp;detail dan proses dari Seleksi Pra Inkubasi Anda</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p><small>Email ini dikirimkan secara otomatis oleh sistem, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</small></p>'),
(26, 'be_notif_registration_juri', '<p>Yth,&nbsp;<br />\nUsername&nbsp;<strong>{%username%}</strong></p>\n\n<p>Selamat, akun Anda sebagai <strong>{%type%}</strong> dengan username <strong>{%username%}</strong>&nbsp;telah <strong>AKTIF</strong> dan dapat digunakan untuk penilaian seleksi.</p>\n\n<p>Silahkan login untuk melihat&nbsp;detail akun Anda dan melakukan Perubahan Data Pengguna anda.<br />\nPassword : &nbsp;<strong>{%password%}</strong></p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p>&nbsp;</p>\n\n<p><small>Email ini dikirimkan secara otomatis oleh sistem, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</small></p>'),
(27, 'be_notif_praincubation_accepted', '<p style=\"text-align:right\">Cibinong, {%curdate%}</p>\n\n<p>No &nbsp; &nbsp; &nbsp; : B-2970 /JI.4/UM/XI/2017</p>\n\n<p>Lamp &nbsp; : 2 Lembar</p>\n\n<p>Perihal : Pengumuman Hasil Seleksi Inkubasi Teknologi {%selection_year%}</p>\n\n<p>&nbsp;</p>\n\n<p>Kepada Yth.</p>\n\n<p><strong>{%user_name%}</strong></p>\n\n<p>Di tempat</p>\n\n<p>&nbsp;</p>\n\n<p>Dengan Hormat,</p>\n\n<p>Menindaklanjuti hasil presentasi dan penjurian proposal yang telah dilakukan dalam rangka Seleksi Kegiatan Inkubasi Teknologi LIPI tahun anggaran {%selection_year%} pada tanggal {%adm_date%} yang lalu dengan ini kami informasikan bahwa proposal yang Saudara usulkan :</p>\n\n<p style=\"text-align:center\"><strong><span style=\"font-size:22px\">DITERIMA</span></strong></p>\n\n<p>Demikian yang dapat disampaikan, atas perhatiannya diucapkan terimakasih.</p>\n\n<p>&nbsp;</p>\n\n<p>Tembusan Yth :</p>\n\n<ol>\n	<li>Sekretaris Utama LIPI</li>\n	<li>Deputi Bidang Jasa Ilmiah LIPI</li>\n	<li>Kepala P2 Bioteknologi LIPI</li>\n	<li>Kepala Balai Penelitian Teknologi Bahan Alam LIPI</li>\n	<li>Kepala P2 Informatika LIPI</li>\n</ol>'),
(28, 'be_frontend_profil', '<p><strong>Mengenai Pusat Inovasi LIPI</strong></p>\n\n<p><span style=\"background-color:#ffffff; color:#777777; font-family:Roboto,Arial,Tahoma,sans-serif; font-size:14px\">Pusat Inovasi LIPI, berdiri pada bulan Juni 2001, merupakan salah satu Pusat dari 22 Pusat Penelitian yang ada di LIPI. Disamping Pusat Penelitian juga terdapat Inspektorat, 5 Biro, dan 20 UPT yang lokasinya terdistribusi di berbagai daerah di tanah air. Pusat Inovasi berada didalam Kedeputian Bidang Jasa Ilmiah - LIPI. Semenjak tanggal 13 Februari 2013, Pusat Inovasi LIPI berpindah kantor ke gedung baru yang berlokasi di komplek Cibinong Science Center-Botanical Garden (CSC-BG) di Cibinong, Jawa Barat. This facility equipt with several office rooms for tenants, workshop, function rooms, meeting rooms, and display room to accelerate LIPI&#39;s research utilization into business and applied widely to users. This facility known as Incubator LIPI.</span></p>'),
(29, 'be_frontend_task', '<p><strong>Tugas Inkubator Teknologi</strong></p>\n\n<p>Pusat Inovasi mempunyai dua tugas pokok yaitu :</p>\n\n<ul>\n	<li>Melakukan kajian, membangun dan mendukung kegiatan kerjasama yang dilakukan oleh berbagai pusat penelitian dan UPT LIPI dengan pihak di luar LIPI, terutama dengan industri, dalam upaya pemanfaatan hasil penelitian dan pengembangan LIPI.</li>\n	<li>Menelaah kemungkinan perlindungan kekayaan intelektual hasil litbang LIPI serta melaksanakan proses untuk mendapatkan perlindungan tersebut.</li>\n</ul>\n\n<p>&nbsp;</p>'),
(30, 'be_frontend_function', '<p style=\"text-align:justify\"><strong>Fungsi Inkubator Teknologi</strong></p>\n\n<p style=\"text-align:justify\">Lorem ipsum dolor sit amet, ut duo atqui exerci dicunt, ius impedit mediocritatem an. Pri ut tation electram moderatius. Per te suavitate democritum. Duis nemore probatus ne quo, ad liber essent aliquid pro. Et eos nusquam accumsan, vide mentitum fabellas ne est, eu munere gubergren sadipscing mel.</p>'),
(31, 'be_frontend_praincubation', '<p style=\"text-align:justify\"><span style=\"background-color:#ffffff; color:#777777; font-family:Roboto,Arial,Tahoma,sans-serif; font-size:14px\">LIPI sebagai lembaga penelitian terbesar dan tertua di Indonesia selain berkontribusi aktif dalam peningkatan kapasitas ilmiah bangsa melalui berbagai macam jurnal nasional/internasional, kajian keilmuan, dan peningkatan hak kekayaan ilmiah juga memiliki tanggungjawab untuk meningkatkan kapasitas penelitiannya agar invensi tersebut bisa digunakan di masyarakat dan industri. Untuk tujuan itulah kelembagaan Inkubator Teknologi LIPI dibentuk dan dikembangkan. Pusat Inovasi LIPI sebagai pengelola Inkubator Teknologi LIPI membuka kesempatan bagi inventor/peneliti/wirausaha untuk mengembangkan ide/invensinya sehingga pada akhirnya bisa dimanfaatkan oleh masyarakat/industri Inkubator Teknologi LIPI. Beragam fasilitas yang ditawarkan oleh Inkubator Teknologi LIPI antara lain sewa kantor yang murah (Rp.500.000/bulan), yang sudah termasuk internet dan listrik serta fasilitas gedung workshop/bengkel produksi, ruang pertemuan, fasilitas promosi dan juga fasilitas pendampingan yang rutin diberikan diharapkan menjadi pendorong bagi wirausaha agar mampu bersaing dalam mengembangkan usahanya.</span></p>'),
(32, 'be_frontend_praincubation_note', '<p style=\"margin-left:0px; margin-right:0px; text-align:center\"><strong>CATATAN PENDAFTARAN KEGIATAN PRA INKUBASI DAN STP</strong><br />\n(*) mengindikasikan wajib diisi.</p>\n\n<ul>\n	<li>Masukkan Username Pengguna anda dengan benar. Jika belum terdaftar, silahkan mendaftar pada menu Pendaftaran Pengguna di bawah.</li>\n	<li>Isi formulir dengan informasi sebenar-benarnya. Jika kami mendapati informasi palsu, usulan anda tidak akan diproses.&nbsp;</li>\n	<li>Pastikan dokumen di unggah sesuai dengan ketentuan format file.</li>\n	<li>Lihat email anda untuk melihat konfirmasi sistem. Bisa di inbox surat atau spam.</li>\n</ul>'),
(33, 'be_frontend_incubation_note', '<p style=\"margin-left:0px; margin-right:0px; text-align:center\"><strong>CATATAN PENDAFTARAN KEGIATAN INKUBASI/PERUSAHAAN</strong><br />\n(*) mengindikasikan wajib diisi.</p>\n\n<ul>\n	<li>Masukkan Username Pengguna anda dengan benar. Jika belum terdaftar, silahkan mendaftar pada menu Pendaftaran Pengguna di bawah.</li>\n	<li>Isi formulir dengan informasi sebenar-benarnya. Jika kami mendapati informasi palsu, usulan anda tidak akan diproses.&nbsp;</li>\n	<li>Pastikan dokumen di unggah sesuai dengan ketentuan format file.</li>\n	<li>Lihat email anda untuk melihat konfirmasi sistem. Bisa di inbox surat atau spam.</li>\n</ul>'),
