(35, 'be_notif_incubation_confirm', '<p>Seleksi Inkubasi Anda dengan judul <strong>{%event_title%}</strong> telah <strong>DIKONFIRMASI</strong>. Selanjutnya akan dilakukan proses penilaian.</p>\n\n<p>Silahkan login untuk melihat&nbsp;detail dan proses dari Seleksi Inkubasi Tenant Anda</p>\n\n<p>&nbsp;</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p>Demikian informasi yang dapat disampaikan.&nbsp;Email ini dikirimkan secara otomatis oleh system, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</p>\n\n<p>&nbsp;</p>'),
(36, 'be_notif_registration_pengusul', '<p>Yth,<br />\nUsername&nbsp;<strong>{%username%}</strong></p>\n\n<p>Selamat, akun Anda dengan username <strong>{%username%}</strong>&nbsp;telah <strong>AKTIF</strong> dan dapat digunakan untuk pendaftaran seleksi.<br />\n<a href=\"http://inovasi.lipi.go.id/inkubator/berkasdigital\"><strong>Klik di sini</strong></a> untuk mengunduh Buku Panduan, Format Proposal dan Format RAB<br />\n<a href=\"http://inovasi.lipi.go.id/inkubator/seleksi/prainkubasi\"><strong>Klik di sini</strong></a> untuk melakukan pendaftaran Seleksi Pra-Inkubasi (Internal LIPI)<br />\n<a href=\"http://inovasi.lipi.go.id/inkubator/seleksi/inkubasi\"><strong>Klik di sini</strong></a> untuk melakukan pendaftaran Seleksi Inkubasi (Perusahaan/Eksternal LIPI)</p>\n\n<p>Silahkan login untuk melihat&nbsp;detail dan proses dari Seleksi Pra-Inkubasi atau Seleksi Inkubasi&nbsp;Anda<br />\n<a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p>&nbsp;</p>\n\n<p><small>Email ini dikirimkan secara otomatis oleh sistem, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</small></p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>'),
(37, 'be_notif_incubation_confirm2', '<p>Seleksi Inkubasi Anda dengan judul <strong>{%event_title%}</strong> telah <strong>DIKONFIRMASI</strong>. Selanjutnya akan dilakukan proses penilaian pada tahap 2.</p>\n\n<p>Silahkan login untuk melihan detail dan proses dari Seleksi Inkubasi Anda</p>\n\n<p>&nbsp;</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p>Demikian informasi yang dapat disampaikan.&nbsp;Email ini dikirimkan secara otomatis oleh system, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</p>\n\n<p>&nbsp;</p>'),
(38, 'be_notif_incubation_not_success', '<p style=\"text-align:right\">Cibinong, {%curdate%}</p>\n\n<p>No&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : B- 2780 /JI.4/UM/XI/2017</p>\n\n<p>Lamp&nbsp;&nbsp; : -</p>\n\n<p>Perihal : Pengumuman Hasil Seleksi Awal Inkubasi Teknologi {%selection_year%}</p>\n\n<p>&nbsp;</p>\n\n<p>Kepada Yth.</p>\n\n<p><strong>{%user_name%}</strong></p>\n\n<p>di Tempat</p>\n\n<p>&nbsp;</p>\n\n<p>Dengan Hormat,</p>\n\n<p>Menindaklanjuti hasil seleksi Administrasi dan Substansi Awal yang telah dilakukan dalam rangka Seleksi Kegiatan Inkubasi Teknologi LIPI tahun anggaran {%selection_year%} pada tanggal {%adm_date%} yang lalu, dengan&nbsp; ini kami informasikan bahwa proposal yang Saudara usulkan</p>\n\n<p style=\"text-align:center\"><span style=\"font-size:22px\"><strong>TIDAK LOLOS SELEKSI AWAL</strong></span></p>\n\n<table border=\"0\" cellpadding=\"1\" cellspacing=\"1\" style=\"margin-left:50px; width:80%\">\n	<tbody>\n		<tr>\n			<td style=\"width:208px\"><strong>&nbsp; Pengusul </strong></td>\n			<td style=\"text-align:center; width:20px\"><strong>&nbsp; :</strong></td>\n			<td>&nbsp;<strong>{%user_name%}</strong></td>\n		</tr>\n		<tr>\n			<td style=\"width:208px\"><strong>&nbsp; Judul Proposal</strong></td>\n			<td style=\"text-align:center; width:20px\"><strong>&nbsp; :</strong></td>\n			<td>&nbsp;<strong>{%event_title%}</strong></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>&nbsp;</p>\n\n<p>Adapun pertimbangan yang mempengaruhi hasil seleksi usulan Saudara mencakup salah satu/beberapa alasan berikut :</p>\n\n<ol>\n	<li>Proposal usulan tidak sesuai dengan format yang sudah disediakan</li>\n	<li>Proposal usulan masih berupa kegiatan ide/riset/budidaya</li>\n	<li>Tidak tergambar prospek pasar/bisnis dan output yang jelas</li>\n	<li>Proposal usulan tidak menggambarkan secara detail proses teknologi/invensi yang digunakan</li>\n	<li>Proposal usulan tidak perlu dibiayai lagi dari kegiatan inkubasi karena bisnis sudah berjalan</li>\n</ol>\n\n<p>Demikian yang dapat disampaikan, atas perhatian Saudara diucapkan terima kasih.</p>\n\n<p>&nbsp;</p>\n\n<p>Tembusan Yth :</p>\n\n<ol>\n	<li>Sekretaris Utama LIPI</li>\n	<li>Deputi Bidang Jasa Ilmiah LIPI</li>\n	<li>Kepala Satuan kerja LIPI /Direktur perusahaan terkait</li>\n</ol>'),
(39, 'be_notif_incubation_not_success2', '<p style=\"text-align:right\">Cibinong, {%curdate%}</p>\n\n<p>No&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : B-2976 /JI.4/UM/XI/2017</p>\n\n<p>Lamp&nbsp;&nbsp; : 2 Lembar</p>\n\n<p>Perihal : Pengumuman Hasil Seleksi Inkubasi Teknologi {%selection_year%}</p>\n\n<p>&nbsp;</p>\n\n<p>Kepada Yth.</p>\n\n<p><strong>{%user_name%}</strong></p>\n\n<p>Di tempat</p>\n\n<p>&nbsp;</p>\n\n<p>Dengan Hormat,</p>\n\n<p>Menindaklanjuti hasil presentasi dan penjurian proposal yang telah dilakukan dalam rangka Seleksi Kegiatan Inkubasi Teknologi LIPI tahun anggaran {%selection_year%} pada tanggal {%adm_date%} yang lalu dengan ini kami informasikan bahwa proposal yang Saudara usulkan,</p>\n\n<p style=\"text-align:center\"><span style=\"font-size:22px\"><strong>TIDAK LOLOS SELEKSI</strong></span></p>\n\n<p>Adapun pertimbangan yang mempengaruhi hasil seleksi usulan Saudara mencakup salah satu/beberapa alasan berikut :</p>\n\n<p>1. Hasil penilaian reviewer tidak mencapai batas kelulusan</p>\n\n<p>2. Usulan saudara belum sesuai dengan output yang diharapkan melalui kegiatan Inkubasi Teknologi</p>\n\n<p>&nbsp;</p>\n\n<p>Atas partisipasi serta perhatian Saudara kami ucapkan terimakasih.</p>\n\n<p>&nbsp;</p>\n\n<p>Tembusan Yth :</p>\n\n<ol>\n	<li>Sekretaris Utama LIPI</li>\n	<li>Deputi Bidang Jasa Ilmiah LIPI</li>\n</ol>'),
