(42, 'be_notif_registration_for_admin', '<p>Yth,<br />\n<strong>Administrator</strong>&nbsp;</p>\n\n<p>Permohonan pendaftaran Akun Pengguna Baru dengan data pengguna sebagai berikut :</p>\n\n<ol>\n	<li style=\"text-align:justify\">Username :<strong>&nbsp;{%username%} </strong></li>\n	<li style=\"text-align:justify\">Nama :<strong>&nbsp;{%name%} </strong></li>\n</ol>\n\n<p>Silahkan Administrator periksa pada Daftar Pengguna dan melakukan <strong>Aktivasi</strong> akun pengguna atas&nbsp;Username <strong>{%username%} </strong>tersebut.</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p><small>Email ini dikirimkan secara otomatis oleh sistem, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</small></p>'),
(43, 'be_notif_contact', '<p>Yth,<br />\n<strong>Administrator</strong></p>\n\n<p>Pengguna&nbsp;<strong>{%name%}</strong> dengan email <strong>{%email%}</strong> mengirim pesan sebagai berikut :</p>\n\n<p>Judul : <strong>{%title%}</strong></p>\n\n<p>Isi Pesan :<br />\n{%description%}</p>\n\n<p><a href=\"http://inovasi.lipi.go.id/inkubator/login\"><strong>Klik di sini untuk login</strong></a></p>\n\n<p><small>Email ini dikirimkan secara otomatis oleh sistem, oleh karenanya tidak diperkenankan untuk dibalas (Reply/Reply To All).</small></p>');
