(1, 'ofcozivhc3', 2017, 1, 174, 0, 'rikiruhimat', 'Riki Ruhimat, S.P', 'Eskalasi Produksi Pupuk Organik Biosiklofarm CSL D', 'Pengembangan pengolahan pupuk organik Biosiklofarm CSL di Kawasan CSC BG - LIPI  untuk membangun suatu model teknologi pengolahan pupuk organik berkualitas melalui proses pemanfaatan limbah organik terformulasi yang terintegrasi dalam kegiatan Biovillage  dan Kawasan CSC BG - LIPI yang dapat diadopsi di daerah.', 'lingkungan', 1, 180, 45, 2, 0, 0, 0, 0, '2017-09-15 10:30:35', '2017-09-15 11:18:39', 0),
(2, 'a5kzrupuck', 2017, 1, 205, 0, 'tutie2018', 'Dra. Tutie Djarwaningsih, M.Si.', 'TEKNOLOGI EKSTRAK KERING PEWARNA ALAM DARI KECAPI ', 'Penyedia bentuk produk pewarna alami khususnya pada batik yang relatif lebih mudah didapatkan dan memperlancar proses pemakaiannya bagi para pengrajin batik.', 'lingkungan', 1, 150, 38, 2, 0, 0, 0, 0, '2017-09-15 15:02:00', '2017-09-15 15:10:31', 1),
(3, 'nfe5bm8ubw', 2017, 1, 159, 0, 'andayani', 'Dr. Desak Gede Sri Andayani', 'Produksi Biopestisida dari Streptomyces sp. TT10', 'Biopestisida akan diproduksi secara fermentasi menggunakan media alam (pati, glukosa, tripton, ekstrak ragi, molase dan air tahu) oleh Streptomyces sp. TT10\r\nSpesifikasi produk: ukuran bawah 100 nm, Fungsi: agen biopestisida, Fitur: berwarna coklat, bentuk padat dan cair.\r\nBiopestisida diperlukan sepanjang tahun, penggunaannya telah meningkatkan produksi pertanian secara signifikan terutama untuk buah-buahan tropis dan tanaman hortikultura. Pengaplikasian agen biokontrol/biopestisida selain menjaga buah -buahan tropis dari penyakit juga berfungsi menyuburkan tanaman dan menjaga unsur – unsur hara dalam tanah tetap seimbang serta menjaga kelestarian ekosistem. \r\nPeraturan pemerintah tentang produksi pestisida serta standar kesehatan yang diterapkan yang akan membawa Indonesia menjadi salah satu Negara penghasil biopestisida. Berdasar kepada peraturan undang-undang keamanan pangan menyebabkan bahan baku pestisida sintesis perlu diseleksi secara ketat, sehingga dengan memproduksi biopestisida, selain memenuhi kebutuhan dalam negeri, biopestisida dapat menjadi sumber devisa Negara.\r\nKesiapan teknologi: IRL 6', 'material_maju', 1, 190, 48, 2, 0, 0, 0, 0, '2017-09-15 16:09:02', '2017-09-15 17:06:05', 1),
(4, 'u1ro3qfdam', 2017, 1, 198, 0, 'desriani', 'Dr. Eng. Desriani, MSi', 'Uji stabilitas kit deteksi SNP  HER-2 pada pasien ', 'HER-2 (Human epidermal growth faktor receptor) merupakan proto-onkogen yang berlokasi pada kromosom 17q21 yang mengkodekan glikoprotein yang digolongkan kedalam superfamili tirosin kinase. Protein ini berperan terhadap sinyal transduksi dan proliferasi sel, serta memberi kontribusi penting terhadap kanker payudara manusia. Secara klinik, overekspresi gen HER-2 diasosiasikan dengan tumor yang bersifat agresif dan memiliki prognosis yang rendah.  Penyebab timbulnya prognosis buruk pada kanker payudara yang mengalami overekspresi HER-2 yaitu:\r\n1.	Meningkatnya properti sel-sel kanker metastasis seperti angioinvasi, angiogenesis.\r\n2.	Timbulnya resistensi terhadap obat dan terapi yang diberikan.\r\n3.	Proliferasi yang tinggi dengan karakteristik presentase yang tinggi pada fase-S yang diduga berhubungan dengan ukuran tumor.\r\n4.	HER-2 onkogen berhubungan dengan keagresifan tumor dan meningkatnya amplifikasi gen tersebut.\r\n5.	Differensiasi sel yang buruk, metastasis, kekambuhan, kematian yang tinggi.\r\n\r\nPengobatan yang terorientasi dan tertarget untuk kanker payudara yang mengalami overekspresi HER-2 adalah dengan menggunakan antibodi monoklonal trastuzumab.  Rekomendasi durasi pengobatan yang dilakukan oleh ESMO (European Society Medical Oncology) adalah satu tahun pengobatan dengan trastuzumab. Begitu juga dengan NCCN (National Comprehensif Cancer Network) dan St Gallen, juga merekomendasikan pengobatan dengan trastuzumab pada durasi yang sama untuk kanker payudara jenis ini. Biaya yang dikeluarkan untuk pembelian antibodi monoclonal trastuzumab per-ampulnya untuk satu bulan pemakaian berada pada kisaran dua puluh jutaan rupiah.  Sehingga dibutuhkan pertimbangan yang cukup matang apabila akan menggunakan pengobatan dengan cara ini. \r\n\r\nPemeriksaan yang dilakukan sebagai dasar rekomendasi pengobatan dengan antibody trastuzumab pada pasien kanker payudara sub type HER-2 yang telah di diakui dan diterima oleh FDA adalah Immunohistochemistry (IHK), FISH, CISH. Dari kesemua metode tersebut, metode IHK merupakan metode yang paling banyak digunakan dikarenakan ongkos pemeriksaan yang dikeluarkan untuk pemeriksaan relative lebih murah dibanding metode lainnya. Sementara itu, dari beberapa hasil laporan menunjukkan bahwa angka resistensi terhadap trastuzumab tinggi berada pada kisaran angka 60-80%. Hal ini menunjukkan, pemeriksaan IHK saja tidak cukup sebagai dasar untuk pengobatan dengan trastuzumab. Polimorfisme HER-2, I655V pada kodon 655 (ATC/Isoleusin menjadi GTC/Valine) yang berada pada domain transmembran dilaporkan dapat dijadikan sebagai biomarker atau faktor prediktif respon individu terhadap trastuzumab yang diberikan pada pasien kanker HER-2. Disamping itu polimorphisme HER-2 pada domain transmembrane juga diinvestigasi berkaitan dengan resiko kerentanan terhadap kanker. Tumor yang membawa polimorfisme I655V menunjukkan potensi tumorigenik yang lebih tinggi (Beauclair dkk., 2007). Hal ini didukung oleh data hasil  penelitian secara preklinik (Han dkk., 2014), dan diperkuat oleh hasil yang diperoleh oleh Lu dkk., (2011) melalui studi meta analisis.\r\n\r\nKami telah mengembangkan paket sistem deteksi SNP HER-2 I655V, pemeriksaan menggunakan mesin realtime PCR dengan teknik Tm Shift SYBR Green I dan berbasis PCR standar. Pemeriksaan dengan teknik Tm Shift SYBR Green I telah kami patenkan, dengan no paten terdaftar P00201507468 dan P00201701284. Pada tahun 2016, pemeriksaan Tm Shift SYBR Green I dinyatakan lulus seleksi 108 inovasi Indonesia. Metoda yang kami kembangkan untuk deteksi SNP HER-2 I655V ini juga telah kami karakterisasi dan kami validasi secara proses untuk skala laboratorium lewat pendanaan kegiatan Unggulan LIPI, dan pada tahun 2017 telah dilakukan uji stabilitas selama 6 bulan berikut uji kompatibilitas alat dan blind tes. Dalam pelaksanaan uji pada 2017, teknik dengan pendekatan realtime PCR menunjukkan spesifisitas yang tinggi sedangkan teknik deteksi berbasis PCR standar memerlukan modifikasi untuk meningkatkan spesifisitasnya. Untuk itu, pada kegiatan 2018, uji stabilitas akan dilanjutkan pada metoda dengan teknik Tm Shift SYBR Green I realtime PCR untuk mendapatkan data stabilitas selama satu tahun. Saat ini, kit deteksi SNP HER-2 telah memiliki dokumen NDA antara Pusat Penelitian Bioteknologi LIPI dan PT Phapros. Data uji stabilitas merupakan salah satu yang disyaratkan oleh Kemenkes sebagai institusi yang mengeluarkan izin edar alat kesehatan. Prediksi kami, stabilitas dan batas kadaluarsa kit deteksi SNP HER-2 mengikuti stabilitas dan batas kadaluarsa kit polimerisasi PCR yang merupakan bagian dari kit deteksi ini,  tetapi untuk itu perlu dibuktikan melalui hasil penelitian dilaboratorium. Disamping itu, sebagaimana telah disampaikan diatas, kit deteksi SNP HER-2 telah memiliki dokumen NDA dengan PT Phapros Tbk. Sebagai tindak lanjutnya dibutuhkan diskusi dan pertemuan yang intens dengan PT Phapros.  Pada hari kamis 14 september 2017, telah dilakukan pertemuan dan diskusi dengan PT Phapros, untuk membicarakan mengenai kelengkapan dokumen yang diperlukan untuk pendaftaran alat kesehatan ke KEMENKES RI dan dokumen lain yang harus disiapkan. Bersama dengan PT Phapros, kedepannya juga akan dibutuhkan serangkaian diskusi dengan komite etik litbang Depkes terkait dengan izin edar tersebut.  Menurut dr. Indirastuti dari PT Phapros berdasarkan pengalaman beliau untuk mengurus izin edar obat, dengan dukungan penuh dari BP POM perizinan komersialisasi produk paling cepat berlangsung selama tiga bulan. Tetapi biasanya membutuhkan waktu lebih kurang dua tahun, dikarenakan juga harus dilakukan pengecekan nama bakal produk tidak memiliki kesamaan nama dengan nama produk-produk lain yang beredar didunia.  Untuk izin edar alat kesehatan kemungkinan akan memiliki pola yang sama. \r\n\r\nDana yang diajukan diatas akan digunakan untuk kegiatan uji stabilitas kit deteksi SNP HER-2 (memerlukan regen kimia: kit untuk proses amplifikasi realtime PCR, primer, media dan bahan-bahan untuk kultur bakteri dan preparasi kontrol positif kit deteksi, berikut analisa nya untuk konfirmasi hasil),  perjalanan (PT Phapros, KEMENKES RI, Litbangkes RI, RSCM, RS Kanker Dharmais, RS Sutomo), beserta narasumber. Pada kunjungan ke RSCM dan RS Dharmais (mewakili rumah sakit besar di Indonesia bagian barat) dan ke RS Sutomo (mewakili rumah sakit besar di Indonesia bagian timur), kemungkinan kit deteksi ini akan diuji cobakan untuk validasi langsung, sekaligus untuk mempromosikan dan sosialisasi kit ini kepada calon penggunanya. \r\n \r\nTujuan :\r\n1. Untuk mendapatkan kit deteksi SNP HER-2 pasien kanker payudara yang telah tervalidasi (sudah mengalami uji stabilitas selama 1 tahun). \r\n2. Mematangkan proses komersialisasi kit deteksi SNP HER-2 dengan PT Phapros Tbk. \r\n\r\nKesiapan teknologi: Menurut kami berada pada skala 7. (publikasi, contoh produk, dan paten telah dipenuhi).  \r\n\r\n•	Merupakan metoda nondestruktif, mudah dan dapat dikerjakan secara massif.\r\n•	Perbedaan melting temperature dan profil kurva yang dihasilkan dapat digunakan untuk membedakan sampel DNA walau hanya dengan perbedaan satu basa. \r\n•	Pada teknik yang dikembangkan ini, menggunakan dua primer forward dan satu primer reverse. Kedua primer forward primer memiliki ekor yang berbeda panjangnya, dan basa di ujung 3’ diberi mismatch. Penggunaan SYBR Green I sebagai pelabel, menjadikan metoda yang dikembangkan ini memiliki harga yang cukup ekonomis.\r\n•	Waktu yang dibutuhkan untuk preparasi sampai analisa cukup singkat yaitu lebih kurang selama 3jam pengerjaan.\r\nKit deteksi SNP HER-2 yang dikembangkan mudah untuk dilakukan, cepat proses pengerjaan, dapat dilakukan untuk pemeriksaan sampel dalam jumlah besar dan murah. Dari hasil analisa pasar yang dilakukan oleh Pak Adit dkk dari PUSINOV LIPI, biaya pemeriksaan untuk lebih kurang 40 sampel pemeriksaan adalah 4,8 juta rupiah. Harga ini cukup kompetitif bila dibandingkan dengan produk yang similar yang telah dikeluarkan oleh  perusahaan Cina dengan merek dagang AmoyDX HER-2, kit deteksi mutasi HER-2 (http://www.amoydiagnostics.com ). Harga jual diIndonesia untuk produk tersebut lebih kurang 35 juta rupiah dengan jumlah set reaksi yang lebih rendah (hasil pembicaraan dengan salah satu suplier diagnostik diIndonesia)\r\n\r\nTingkat inovasi: Tingkat 7.\r\nPemeriksaan dengan teknik Tm Shift SYBR Green I telah kami patenkan, dengan no paten terdaftar P00201507468 dan P00201701284, telah dikarakterisasi dan divalidasi secara proses. Pada tahun 2016 pemeriksaan Tm Shift SYBR Green I dinyatakan lulus seleksi 108 inovasi Indonesia, dan pada tahun 2017 telah memiliki NDA kerjasama dengan PT Phapros Tbk.', 'kesehatan_farmasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-16 08:56:26', '2017-09-16 09:38:31', 1),
(5, 'jnq7py5vwy', 2017, 1, 24, 0, 'radenrifal', 'Raden Rifal Ardiansyah', 'Tes PraInkubasi', 'Tes PraInkubasi Seleksi', 'elektronika_informasi_komunikasi', 1, 0, 0, 0, 0, 0, 0, 0, '2017-09-16 09:02:23', '2017-09-25 10:12:53', 0),
(6, 'eruvjyuz7h', 2017, 1, 222, 0, 'yopisunarya', 'Yopi', 'ENZYME MAN_Ks : Biokatalis untuk Degradasi Biomasa', 'Tujuan kegiatan adalah melakukan produksi enzim mananase skala fermentor 50 L (menggunakan biorekator yang tersedia di Puslit Bioteknologi & Pusinov LIPI) untuk penyediaan produk yang terstandar. Sasaran kegiatan ini diperolehnya produk terstandard melalui proses produksi menggunakan fermentor, dan berdasarkan hasil tersebut diharapkan dapat dijalin kerjasama dengan perusahaan yang membutuhkan produk biokatalis.', 'pangan_agroindustri', 1, 310, 78, 3, 2, 0, 0, 1, '2017-09-16 10:17:15', '2017-09-22 18:56:48', 1),
(7, '2zwrzxqsgi', 2017, 1, 167, 0, 'uti.sari', 'dr. Uti Nilam Sari, M.Sc', 'uCare', 'uCare adalah integrator dan penyedia layanan kesehatan berbasis rumah (home health care) yang komprehensif. uCare membawa tenaga medis (dokter, perawat, fisioterapis, dll), peralatan medis, dan obat-obatan beserta  Ambulance ke rumah pasien. uCare akan memberikan pelayanan kesehatan komprehensif seperti di Rumah Sakit dimulai dari pengkajian, diagnosis, pengobatan, sampai dengan follow-up kondisi pasien, namun dilakukan di rumah.', 'kesehatan_farmasi', 1, 50, 25, 1, 0, 0, 0, 0, '2017-09-16 15:22:51', '2017-09-16 17:36:16', 1),
(8, 'uzu12na3l4', 2017, 1, 152, 0, 'rayafamily', 'MUHAMAD TIRTA', 'SYSTEM TEKNOLOGI ASSESMENT UNTUK PENINGKATAN UMKM', 'SYSTEM TEKNOLOGI ASSESMENT UNTUK PENINGKATAN UMKM', 'elektronika_informasi_komunikasi', 1, 30, 15, 1, 0, 0, 0, 0, '2017-09-17 06:10:48', '2017-09-17 09:09:56', 1),
(9, 'lyhtp6r7vl', 2017, 1, 239, 0, 'etilipi2017', 'Elvi Yetti', 'STANDARISASI DAN SCALE UP PRODUK FORMULASI KONSORS', '1)	Tujuan invensi ini adalah untuk memperoleh produk konsorsium bakteri yang mengandung kombinasi dari 4 (empat) isolat bakteri laut  yakni Labrenzia sp. MBTDCMFRIMab26 yang memiliki aktivitas atau kemampuan mendegradasi senyawa hidrokarbon aromatilk polisiklikdanLabrenzia aggregata strain HQB397 yang memiliki aktivitas atau kemampuan mendegradasi senyawa alkana,yang diformulasikan untuk meningkatkan kemampuan isolat-isolat tsb dalam mendegradasi limbah minyak.\r\nInvensi ini berkaitan dengan produk yang diformulasikandari campuran bakteri Labrenzia sp. MBTDCMFRIMab26danLabrenzia aggregata strasin HQB397, dalambentukkeringbeku (tepung)untukmeningkatkandayadegradasibakterilautdalambioremediasilimbahminyak yang mengandungsenyawaalkanabaikrantaipendek, panjang, lurusdanbercabangdansenyawahidrokarbonaromatickpolisiklik', 'lingkungan', 1, 130, 33, 2, 0, 0, 0, 0, '2017-09-17 08:26:45', '2017-09-17 09:09:56', 1),
(10, 'lcftolgwo9', 2017, 1, 225, 0, 'liling', 'Liling Triyasmono', 'PRAINKUBASI LOZENGES (TABLET HISAP) EKSTRAK AKAR P', 'Produksi Lozenges (Tablet Hisap) Ekstrak Akar Pasak Bumi Borneo dalam rangka peningkatan mutu produk dan penjaminan keamanan produk, khasiat produk yang berkualitas. Produksi Lozenges Ekstrak Akar Pasak Bumi memiliki potensi pasar yang besar didasarkan pada konsumsi akar pasak bumi konvensional yang cukup banyak. Produk ini akan lebih menarik daripada produk konvensional karena bentuk dan kepraktisannya.', 'kesehatan_farmasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 10:19:40', '2017-09-17 11:08:21', 1),
(11, '7cdu5l7xzq', 2017, 1, 195, 0, 'nadiafarahiya', 'Dr. Asep Nurhidayat', 'Pengalengan Aneka Sambel Uleg', 'Membuat produk aneka sambal uleg yang diolah secara tradisional dan dikemas secara modern tanpa menggunakan bahan pengawet', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 11:07:30', '2017-09-17 11:08:21', 1),
(12, '6me4w2pq0u', 2017, 1, 228, 0, 'moha057', 'Mohammad Faiz Karimy', 'PENGEMBANGAN USAHA IMBUHAN PAKAN (BioMixPROTM) UNT', 'Peningkatan produktivitas ternak sangat tergantung pada kualitas bibit ternak, ketersediaan pakan, dan manajemen pengelolaan (Sofyan et al., 2007). Permasalahan yang dihadapi adalah langka dan mahalnya harga pakan yang berkualitas dan kontiunuitas ketersediannya (Mahfudz, et al., 2009), serta kurangnya pengetahuan peternak tentang teknologi imbuhan pakan yang menggunakan pendekatan ilmiah untuk menunjang produktifitas ternak. Berkaitan dengan hal tersebut, maka perlu untuk dilakukan proses percepatan untuk peningkatan kapasitas dari konsumsi ternak, yaitu dengan cara memberikan imbuhan pakan organic berbasis mineral organic yang bermanfaat dan menguntungkan bagi ternak. Percepatan tersebut melalui proses pemanfaatan teknologi hasil pengembangan penelitian BPTBA LIPI berupa produk mineral organic BioMixPROTM. Produk ini dirancang untuk mengatasi pemenuhan kebutuhan mineral yang didalamnya mengandung probiotik sekaligus untuk meningkatkan performa sistem pencernaan ternak. Melalui pemberian BioMixPROTM secara teratur pada ternak diharapkan penggunaan pakan dapat lebih efisien, secara bersamaan kesehatan sapi lebih prima dan tidak rentan terserang penyakit, pertambahan bobot tubuhnya dapat meningkat dalam waktu lebih singkat dan kebutuhan mineralnya tercukupi. \r\nBPTBA LIPI adalah lembaga negara setingkat eselon 3 yang telah menghasilkan berbagai temuan penting, termasuk teknologi imbuhan pakan organik untuk ruminansia sebagai imbuhan mineral organik, sehingga memberi efek terhadap peningkatan produksi ternak. KJUB puspetassari merasa perlu mempertimbangkan penggunaan imbuhan pakan organic tersebut lebih lanjut untuk lebih meningkatkan jenis produk yang dipasarkan untuk pengembangan usaha sekaligus memasarkan produk ke seluruh Indonesia. BPTBA LIPI mempunyai tanggung jawab moral, agar produk hasil pengembangan tersebut dapat dirasakan lebih luas oleh masyarakat. Terpilihlah KJUB puspetasari sebagai perusahaan calon tenant yang bekerjasama dengan BPTBA LIPI sebagai inkubator untuk kemudian melakukan kegiatan produksi, sertifikasi, dan pemasaran dengan lisensi dari UPT BPPTK LIPI. Sehingga, kedua produk bermanfaat bagi keamanan pangan produk daging sapi maupun kambing tersebut dapat dirasakan manfaatnya oleh masyarakat luas Indonesia.\r\nDiusulkannya kegiatan Inkubasi Bisnis Teknologi (IBT) tahun 2018 merupakan langkah maju bagi BPTBA LIPI dan KJUB puspetasari, untuk terus meningkatkan diversivikasi produk imbuhan ternak yang diproduksi oleh KJUB puspetasari dan menjadikan KJUB puspetasari koperasi yang semakin mandiri dan berdaya saing dalam bisnis konsentrat makanan ternak dan imbuhan pakan organic untuk ternak ruminansia di Indonesia. Tahun 2018 direncanakan peralihan teknologi produksi imbuhan pakan organik dari BPTBA LIPI kepada KJUB puspetasari. BPTBA LIPI akan mendampingi KJUB puspetasari dalam proses menuju komersialisasi hasil pengembangan penelitian tersebut. Diharapkan, KJUB pupetasari dapat terus tumbuh menjadi koperasi berkelas nasional yang berazaskan pengembangan teknologi hasil penelitian dari BPTBA LIPI.', 'pangan_agroindustri', 1, 380, 95, 3, 2, 0, 0, 1, '2017-09-17 16:26:49', '2017-09-22 18:53:40', 1),
(13, 'f35ruwbn5k', 2017, 1, 247, 0, 'ajeng_as', 'Ajeng Arum Sari, PhD.', 'TEKNOLOGI ELEKTROKOAGULASI MENGGUNAKAN TENAGA SURY', 'Pengolahan limbah organik yang umum dilakukan untuk industri makanan dan minuman terdiri dari pengolahan secara fisik seperti screening, pengolahan biologis seperti lumpur aktif, dan pengolahan kimia seperti koagukasi – flokulasi (Comninellis, 2010). Teknologi yang dikembangkan untuk mengolah air limbah menjadi air bersih adalah elektrokoagulasi menggunakan tenaga surya sebagai pengganti listrik. Elektrokoagulasi dapat didesain untuk berbagai macam kapasitas pengolahan dan memiliki efisiensi penyisihan polutan yang tinggi. Jika dibandingkan dengan koagulasi kimia, elektrokoagulasi menghasilkan lumpur yang lebih sedikit dan lebih stabil (Song et al. 2017). Selain itu elektrokoagulasi memerlukan peralatan yang sederhana dan mudah dioperasikan, lebih cepat mereduksi kandungan koloid/partikel yang paling kecil, dan gelembung-gelembung gas yang dihasilkan dapat membawa polutan terapung sehingga dapat disisihkan (Purwaningsih 2008). Keterbaruan teknologi ini adalah penggunaan panel surya (tenaga matahari) sebagai sumber listrik pada elektroda dalam proses elektrokoagulasi. Sel surya (solar cell) disebut juga divais photovoltaic. Pada prinsipnya divais sel surya mampu mengubah energi matahari menjadi energi listrik secara langsung. Energi listrik yang dihasilkan adalah energi listrik arus searah (DC) (Musila & Mbitu 2012). Kelebihan penggunaan sel surya yaitu lebih ramah lingkungan, tidak menghasilkan gas rumah kaca, dan biaya operasional dan pemeliharaan lebih rendah dibandingkan teknologi energi terbarukan lainnya. Teknologi ini menggunakan reaktor bervolume 50 liter dan sudah diujicobakan untuk mengolah air limbah tahu dan air gambut dari Riau. Hasil yang diperoleh adalah COD air limbah tahu sudah dapat memenuhi baku mutu untuk dibuang ke lingkungan. Selain itu, logam yang terkandung di dalam air gambut dan warnanya juga dapat tersisihkan.\r\nTujuan: mengembangkan teknologi pengolahan air limbah menjadi air bersih dengan menggunakan sistem elektrokoagulasi kapasitas 200 liter dengan panel surya berjumlah 4 buah dengan kapasitas 200 watt. \r\nSasaran:\r\n1.	Reaktor elektrokoagulasi kapasitas 200 liter\r\n2.	Panel surya kapasitas 200 watt yang mampu menyimpan energi sehingga pengoperasian alat dapat dilakukan juga pada malam hari\r\n3.	Sistem elektrokoagulasi dapat digunakan langsung di UKM dengan efisiensi penyisihan COD sebesar 90%', 'lingkungan', 1, 230, 58, 2, 0, 0, 0, 0, '2017-09-17 16:32:41', '2017-09-17 16:43:54', 1),
(14, 'rx4vq8mbpr', 2017, 1, 236, 0, 'sury016', 'Suryo Sembodo', 'BETON RINGAN SELULAR BERBASIS LIMBAH ABU TERBANG B', 'BETON RINGAN SELULAR BERBASIS LIMBAH ABU TERBANG BATUBARA\r\nBeton ringan pada umumnya terdapat dua jenis yaitu autoclaved aerated concrate (AAC) atau disebut juga beton ringan aerasi, dan cellular Lightweight concrate (CLC) atau disebut juga beton ringan selular, mempunyai kesamaan dalam hal gagasan yaitu menambahkan gelembung udara pada beton sehingga membuat beton yang lebih ringan namun memiliki kekuatan yang cukup sebagai bahan bangunan. Beton ringan selular merupakan beton konvesional yang dimana agregat kasar yang biasanya oleh kerikil digantikan dengan gelembung udara/busa dimana fungsi sebagai media pembungkus udara. Ketika udara yang terjebak tersebut hilang pada proses curing secara alami di tempat terbuka, membuat struktur beton yang berpori namun padat. Beton ringan selular adalah beton konvensional yang mana agregat kasar (kerikil) diganti dengan gelembung udara, dalam prosesnya mengunakan busa organik yang kurang stabil dan tidak ada reaksi kimia ketika proses pencampuran adonan, foam/busa berfungsi hanya sebagai media untuk membungkus udara.\r\nBeton ringan aerasi AAC mempunyai bobot isi yang lebih rendah dengan kuat tekan yang cukup, sementara beton ringan selular memiliki bobot isi yang cukup dengan kuat tekan lebih tinggi. Beton AAC lebih banyak diminati karena karakteristik beton ringan dengan bobot isi rendah dan kekuatan yang cukup lebih diminati oleh masyarakat meskipun harganya lebih mahal, namun beton ringan selular tetap menawarkan penurunan berat badan yang cukup besar dibandingkan dengan beton konvensional, dengan keunggulan-keunggulan yang sama dengan AAC yaitu tidak memerlukan plesteran pada dinding, selain itu lebih mudah di potong/gergaji, dipaku dan di sekrup. Keunggulan lainnya beton ringan selular adalah menawarkan banyak ruang lingkup pengaplikasian, dapat dengan mudah di cor dalam berbagai bentuk, contohnya panel dinding rumah seluruhnya dapat dicetak hanya dalam sekali tuang.\r\nBeton ringan aerasi memerlukan investasi alat yang lebih tinggi karena selain memerlukan alat autoclaved, juga memerlukan biaya operasional, dan operator yang terampil, sehingga sulit jika di aplikasikan untuk industri kecil dan menengah. Sedangkan investasi peralatan beton ringan selular hampir sama dengan peralatan yang digunakan untuk menghasilkan beton konvensional seperti batako, selain itu operator yang biasa dengan beton konvensional dapat dengan mudah mengerti karena prosesnya mirip dengan beton konvensional. Dengan keunggulan tersebut beton ringan selular lebih potensial dikembangkan oleh semua jenis industri, khususnya kecil dan menengah. Meningkatnya pembangunan infrastruktur membuat permintaan beton ini akan terus meningkat, disamping itu bahan baku abu terbang yang melimpah dan terus meningkat seiring dengan banyaknya pembangunan PLTU saat ini. \r\nPrototipe beton ringan selular berbasis abu terbang batubara ini setelah di lakukan pengujian memiliki bobot isi sebesar 830-1550 kg/m3 dengan kuat tekan 10,40-148,47 kgf/cm2 dan penyerapan air antara 4,81-21,47%. Dimana menurut SNI 03-3449-2002 tentang “Persyaratan Beton Berdasarkan Tujuan Konstruksi”, beton ringan selular ini dapat diaplikasikan sebagai beton ringan untuk struktur bangunan ringan, sedangkan menurut SNI 03-0349-1989 tentang “Persyaratan Bata Beton Untuk Pasangan Dinding”, beton ini memenuhi persyaratan mutu beton I, II, III, dan IV sebagai beton untuk pasangan dinding.', 'material_maju', 1, 170, 43, 2, 0, 0, 0, 0, '2017-09-17 20:06:07', '2017-09-17 20:31:39', 1),
(15, 'c62lpzpreo', 2017, 1, 17, 0, 'mukhamadangwar', 'Ir. Mukhamad Angwar, M.Sc', 'PENGEMBANGAN TEKNOLOGI DIVERIFIKASI SUSU KAMBING P', 'Produk bubuk gula semut susu kambing PE instan adalah bubuk makanan yang terbuat dari susu segar kambing PE susunan perbandingannya pada formulasi yang ditentukan dilakukan proses pencampuran, pemekatan, pengkristalan, penepungan dan pengemasan.   \r\nTerdapat beberapa varian yaitu susu bubuk kambing PE, susu bubuk kambing PE rasa cokelat, rasa strobery, yoghurt, kefir, keju, susu kental manis. Proses pengolahan produk  berbasis susu bubuk kambing PE instan dilakukan pada UKM Tamto Mandiri  terbuat dari bahan susu segar kambing PE yang dicampur dengan gula melalui proses pencampuran, pemekatan, pengkristalan, penepungan dan pengemasan. Untuk rasa cokelat dan strobery dilakukan pencampuran yang susunan perbandingannya sesuai  formulasi yang ditentukan.   \r\nProses pengolahan produk  yoghurt, kefir, keju meliputi proses pasteurisasi, inokulasi, proses pematangan atau fermentasi, proses pemberian citarasa, pengemasan dan pelabelan. Produk susu kental manis melalui proses pasteurisasi, pencampuran dengan gula, proses pemekatan, pengemasan dan pelabelan.', 'pangan_agroindustri', 1, 160, 80, 1, 0, 0, 0, 0, '2017-09-17 21:59:51', '2017-09-17 22:18:20', 1),
(16, 'nfbytvuc5v', 2017, 1, 257, 0, 'tirtakdewi', 'Tirta Kumala Dewi', 'INOVASI PUPUK ORGANIK HAYATI CAIR BERBASIS MIKROB ', 'Pengembangan pupuk organik hayati cair dengan memanfaatkan limbah pertanian dan peternakan serta berbasis mikrob unggul sehingga mampu menghasilkan produk yang berkualitas dengan harga murah dan ramah lingkungan. Peningkatan nilai limbah pertanian dan peternakan seperti ekstrak kompos dan urin sapi menjadi pupuk organik hayati dengan di perkaya mikrob unggul yang memiliki aktivitas pemacu pertumbuhan tanaman menjadi nilai lebih dalam produk yang di hasilkan. Urin sapi dan ekstrak kompos menjadi bahan dasar pokok yang memiliki kandungan nutrisi yang baik untuk tanaman. Ekstrak kompos mengandung nilai C organik yang tinggi, selain itu di tambahkan dengan molase sebagai sumber karbon lain dan pupuk oragnik hayati cair sebagai bahan yang mengandung mikrob unggul. Pembuatan pupuk organik hayati ini di kemas dengan teknologi sederhana dalam fermentor lokal serta penggunaan ekstraktor kompos untuk mendapatkan ekstrak kompos dengan hasil terbaik.\r\nRuang lingkup pemasaran pupuk organik hayati cair seri “fermented urine” adalah mitra petani dan peternak yang bisa memanfaatkan limbahnya untuk mendukung pertanian organik, selain itu para pelaku pertanian organik yang dari beberapa komoditas yang ingin mendapatkan produk pupuk organik hayati yang murah dan berkualitas. Selain itu hal ini juga akan memberikan solusi untuk mitra swasta yang bergerak di bidang peternakan dalam memanfaatkan limbahnya. Pelaku pertanian organik juga dapat mengusung teknologi ini untuk pengelolaan lingkungan dengan konsep zero waste. \r\nKonsep yang di kembangkan untuk pembuatan pupuk organik hayati cair “fermented urine” telah mampu menghasilkan produk dengan harga yang sangat murah, bahkan bisa kurang dari 10000 per liter. Dengan pembiayaan yang sangat murah dan bahan yang mudah di dapat maka akan menjadi hal penting yang menjadi parameter untuk pengembangannya. Teknologi yang telah di kembangkan di dukung dengan sumber daya manusia yang handal di bidangnya sehingga akan di dapatkan hasil yang maksimal.\r\nKonsep alih teknologi yang di kembangkan adalah dengan pelatihan dan pendampingan kepada mitra yang akan mengadopsi teknologi ini. Pendampingan akan di lakukan dari awal proses produksi sampai mendapatkan hasil produk yang kualitasnya teruji. Calon mitra yang akan mengadopsi teknologi ini akan di latih secara profesional baik dari segi teori konsep sampai praktek pembuatan pupuk yang memiliki kualitas baik.', 'pangan_agroindustri', 1, 240, 60, 4, 2, 0, 0, 0, '2017-09-17 22:36:39', '2017-09-22 18:58:15', 1),
(17, '24rhj603zk', 2017, 1, 230, 0, 'muchamad.hartanto', 'Muchamad Hartanto', 'Standarisai  Pesawat Survei Tanpa Awak Untuk Bersa', 'Pemetaan Bergerak Satelit\r\nDengan memanfaatkan berbagai citra dari ASTER, ALOS, Landsat, atau Quickbird, citra satelit mencakup area yang luas dengan resolusi dan akurasi sub-meter, dan dapat diproses lebih lanjut berdasarkan pada kebutuhan Anda.\r\n\r\nSurvei UAV\r\nSurvei penginderaan jarak jauh yang canggih, memanfaatkan pemicu terbang dan pemotretan berpemandu GPS, memastikan data Anda bebas dari awan dengan akurasi kurang dari 10 cm dan tersedia kapan saja. Rumah kita yang dibangun AUV mampu menjangkau 100ha dalam satu penerbangan (sekitar 1 jam) dan dengan turnaroud misi cepat, ini bisa diulang beberapa kali dalam sehari.\r\n\r\nPenginderaan Jauh\r\nLuas area, gambar banyak tujuan, bisa diandalkan adalah beberapa manfaat survei penginderaan jarak jauh. Berasal dari satelit yang mengorbit bumi atau dari UAV terbang rendah, masing-masing memiliki keuntungan sendiri untuk membantu Anda mendapatkan citra yang lebih besar, dan melaksanakan proyek dengan percaya diri.', 'elektronika_informasi_komunikasi', 1, 20, 10, 1, 0, 0, 0, 0, '2017-09-17 22:41:30', '2017-09-18 05:59:06', 1),
(18, 'd7hvrnvung', 2017, 1, 259, 0, 'mpmompmo', 'Ir. Happy Sembiring, Efendi, S.T., Ir. Eko Tri Sum', 'Material Preservasi Mikro Organisme Sebagai Pengur', 'Scale up dan produksi MPMO untuk memenuhi kebutuhan pengurai limbah cair organik pada industri dalam negri', 'lingkungan', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 22:45:57', '2017-09-18 05:59:06', 1),
(19, 'phuthve9zj', 2017, 1, 243, 0, 'rifalipi', 'Rifa Nurhayati', 'Inkubasi  Peningkatan Kapasitas Produksi Minuman C', 'program Inkubasi Teknologi Pusinov LIPI Tahun 2018 ini bertujuan untuk melakukan alih teknologi diversifikasi produk berbasis cokelat lokal pada Griya Cokelat Nglanggeran di Kabupaten Gunungkidul DIY, diantaranya optimasi peningkatan kapasitas produksi minuman cokelat instan Chocomix, diversifikasi produk olahan cokelat menjadi dark chocolate dan couverture chocolate.\r\nSasaran yang akan dicapai dari kegiatan ini adalah:\r\n1.	Terwujudnya peningkatan kapasitas produksi dan perbaikan kemasan minuman cokelat instan Chocomix di Griya Cokelat Nglanggeran\r\n2.	Terjadi alih teknologi diversifikasi produk berbasis cokelat lokal di Griya Cokelat Nglanggeran\r\n3.	Terciptanya peningkatan kapasitas dan kompetensi wirausahawan baru dengan diversifikasi produk  berbasis cokelat di Griya Cokelat Nglanggeran lewat program Inkubasi Teknologi Pusat Inovasi LIPI', 'pangan_agroindustri', 1, 260, 65, 4, 2, 0, 0, 0, '2017-09-17 23:00:05', '2017-09-22 18:55:03', 1),
(20, 'ufm50azahd', 2017, 1, 252, 0, 'totokwianto', 'Totok Wianto', 'Smart Water Automatic Portable Tenaga Sel Surya  U', 'Smartwater treatment protable merupakan produk inovasi pengolahan air yang inovatif dengan memanfaatkan membran ultrafiltrasi dan reverse osmosis dan menggunakan solar sel dan pompa DC sebagai penggerak sistem tersebut. Produk Smartwater treatment protable memiliki dimensi yang minimalis yaitu 40 x 80 x 30 cm dan dapat disesuaikan dengan dimensi solar cell yang kompak dengan sistem tersebut, dengan sistem yang kompak maka produk ini akan di minati oleh masyarakat. Tenaga pompa berasal dari solar cell dengan daya 100 watt, serta didukung oleh sistem otomatis, sehingga dapat digunakan kapan saja. Untuk mendukung penggunaan malam hari disediakan produk tambahan dengan menggunakan aki untuk menjalankan pompa yang ada.', 'lingkungan', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-17 23:05:45', '2017-09-18 05:59:06', 1),
(21, '0c0k9m1jz4', 2017, 1, 196, 0, 'ardhariksa.zukhruf', 'ardhariksa zukhruf kurniullah', 'Cargo Tracking Enabler Untuk Industri Logistik di ', 'Access reliable capacity on the world’s best air, ocean, truck, and rail carriers at competitive rates from an online dashboard. Take control over your inventory in transit to cut shipping times and reduce working capital', 'elektronika_informasi_komunikasi', 1, 50, 25, 1, 0, 0, 0, 0, '2017-09-17 23:26:19', '2017-09-18 05:59:06', 1),
(22, 'l9ht0kmm3m', 2017, 1, 261, 0, 'luthfianachoirunnisa', 'Lely Rahmawaty, STP, MP', 'Bank Kertas', 'Bank Kertas adalah sebuah program terkait daur ulang kertas dengan pemisahan langsung di gedung-gedung perkantoran terutama gedung pemerintah untuk mendukung program lingkungan. Namun dikombinasikan dengan multimedia dalam pelaksanaan daur ulang kertas yang diproses menjadi kemasan UKM. Ide inovatif yang mendukung gerakan emisi rumah kaca yang dikombinasikan dengan teknologi informasi.', 'elektronika_informasi_komunikasi', 1, 40, 13, 1, 0, 0, 0, 0, '2017-09-18 00:09:21', '2017-09-18 05:59:06', 1),
(23, 'bxz8d0b3qw', 2017, 1, 262, 0, 'muchlis', 'Muchlis, ST, MT', 'Pra-Inkubasi Teknologi Pembersihan Biogas', 'Tujuan kegiatan ini untuk mendapatkan validasi aspek teknis dan bisnis dari teknologi reaktor desulfurisasi biogas berbasiskan sorben reaktif iron oxide impregnated coco coir (IOCC). Sedangkan sasaran yang ingin dicapai adalah:\r\n-	Teridentifikasinya aspek teknis produksi dan bisnis reaktor desulfurisasi biogas berbasiskan sorben IOCC untuk skala komersil.\r\n-	Tervalidasinya kinerja prototipe reaktor desulfurisasi biogas berbasis sorben IOCC melalui pengujian skala lapangan.', 'material_maju', 1, 150, 38, 2, 0, 0, 0, 0, '2017-09-18 00:10:30', '2017-09-18 05:59:06', 1),
(24, 'gm3sv80tbf', 2017, 1, 249, 0, 'srip004', 'Sri Pudjiraharti', 'PENINGKATAN SKALA PRODUKSI DIFRUCTOSE ANHYDRIDE II', 'Produksi DFA III pada skala 150 L dari bahan baku inulin dengan menerapkan variasi kecepatan  pengadukan untuk mendapatkan kecepatan pengadukan yang optimal dengan hasil rendemen yang maksimal.', 'pangan_agroindustri', 1, 270, 68, 4, 2, 0, 0, 0, '2017-09-18 00:17:55', '2017-09-22 18:49:48', 1),
(25, 'zvstsndclf', 2017, 1, 258, 0, 'kiki_yulianto', 'Kiki Yulianto', 'PONIFERA99', 'Tujuan dari kegiatan ini adalah untuk memenuhi pasar, menciptakan lapangan pekerjaan dan memanfaatkan peluang untuk meningkatkan produktivitas Tanaman dengan menciptakan teknologi berupa Pupuk organik cair Berbasis Limbah beraroma buah. Selain itu, Menfaatkan buah-buahan yang sudah terbuang maupun buah yang belum optimal penggunaannya yang akan diolah menjadi pupuk cair beraroma buah sehingga memiliki nilai tambah dan mengatasi permasalahan limbah di Indonesia. Menjadikan  produk yang unggulan ramah lingkungan dan tidak merusak kandungan pada tanaman tersebut  serta memiliki aroma yang khas dan praktis dalam penggunaannya.', 'pangan_agroindustri', 1, 20, 7, 1, 0, 0, 0, 0, '2017-09-18 00:23:07', '2017-09-18 05:59:06', 1),
(26, 'zw9eo1iv38', 2017, 1, 201, 0, 'athontowi', 'Ahmad Thontowi', 'Produksi bioetanol dari limbah kulit casava dengan', 'Kegiatan ini bertujuan untuk memproduksi bioetanol dari kulit casava skala 10L dengan memanfaatkan enzim glukoamilase dan ragi unggul Indonesia. Fokus kegiatan adalah scaling –up fermentasi dan purifikasi untuk mendapatkan bioetanol sesuai standar bahan bakar nabati', 'material_maju', 1, 150, 38, 2, 0, 0, 0, 0, '2017-09-18 08:29:06', '2017-09-18 09:06:36', 1),
(27, '0styr5mjhk', 2017, 1, 245, 0, 'labmtbiotek', 'Dr Roni Ridwan', 'Komersialisasi Produk Probiotik Sapi Perah dan Sap', 'Dalam rangka pengembangan produk dari skala laboratorium ke skala yang lebih besar, maka diperlukan adanya kerjasama dengan mitra swasta. Peningkatan skala produksi ke dalam jumlah yang lebih besar perlu dilakukan proses inkubasi. Selama proses inkubasi ini perlu dilakukan pendampingan kepada mitra dalam proses scale up produksi yang prinsip kerjanya berdasarkan prinsip metode yang digunakan dalam skala laboratorium dengan memperhitungkan jumlah output produk yang lebih besar. Dalam kegiatan ini dilakukan kerjasama dengan Koperasi KPS Bogor, Kelompok Mandiri SPR Kunak, Cibungbulang Bogor) yang bergerak di bidang peternakan untuk melakukan pengembangan produk probiotik.', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 09:08:39', '2017-09-18 09:36:15', 1),
(28, 'lx3b3m5rpn', 2017, 1, 265, 0, 'imadesudianalipi', 'Dr. I Made Sudiana, M.Sc', 'Alih Teknologi Produk Agen Bioremediasi BioREm-L L', 'Produk Biorem-L untuk biodegradasi limbah minyak yang mengandung senyawa alkane rantai panjang, Polyaromatik hydrokarbon dan senyawa karbon berat molekul tinggi.  Produk ini mengandung 15 strain mikroorganisma fungsional yang terimobiliasasi didalam microbial carrier yang sangat baik menjaga kehidupan mikroba fungsional. Microbial carrier dilengkapi dengan nutrisi dan enzim untuk mikroba fungsional sehingga mampu tumbuh dan aktif pada kondisi ekstrem salinitas, dan lipid.', 'lingkungan', 1, 200, 50, 2, 0, 0, 0, 0, '2017-09-18 09:36:47', '2017-09-18 09:41:32', 1),
(29, 'ptwl3qrk7j', 2017, 1, 267, 0, 'starter_culture', 'Dr. Rer. Nat. Fahrurrozi, M.Si.', 'Produksi Starter Culture Fermentasi Kakao, Lemak, ', 'Starter culture sangat diperlukan untuk fermentasi biji kakao basah agar menghasilkan biji kakao kering yang aromanya lebih wangi dan citarasa yang terkontrol, serta secara keseluruhan dapat meningkatkan kualitas dan harga jual biji kakao terfermentasi. Kualitas biji kakao yang baik akan meningkatkan kualitas olahan kakao seperti lemak dan bubuknya.', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 10:24:32', '2017-09-18 10:28:21', 1),
(30, 'cjfslxda0g', 2017, 1, 14, 0, 'rajani', 'Ahmad Rajani', 'Pengembangan Produk Alat Penerangan Multifungsi Un', 'Kegiatan ini merupakan kelanjutan dan pengembangan dari Kegiatan Pra Inkubasi Alat Penerangan Multifungsi pada tahun 2017. Kegiatan Pra Inkubasi Alat Penerangan Multifungsi merupakan kerjasama P2 Telimek-LIPI dengan CV. Intech Manufaktur yang difasilitasi Pusinov - LIPI dengan keluaran 250 buah alat penerangan multifungsi. \r\nPada kegiatan Pra Inkubasi sudah menghasilkan produk dengan baik, namun pada saat dilakukan survey lapangan, memperoleh masukan dari konsumen bahwa bentuk desain casing kurang menarik dan harganya mahal, sehingga perlu untuk dilakukan penyempurnaan produk.\r\nPada kegiatan inkubasi ini akan dilakukan modifikasi pada desain casing dan optimasi fitur produk lampu penerangan multifungsi yang telah di produksi pra inkubasi. Modifikasi desain casing produk ini bertujuan agar desain casing lampu multifungsi yang baru lebih menarik. Desain casing lampu penerangan multifungsi yang baru akan menggunakan moulding, dengan tujuan dapat menekan biaya produksi apabila diproduksi massal dan CV. Intech dalam hal ini sebagai mitra dapat memproduksi secara mandiri. Beberapa fitur yang ada pada lampu multifungsi tersebut jarang digunakan konsumen, sehingga perlu dilakukan modifikasi, agar fitur-fitur yang ada pada produk tersebut sesuai dengan kebutuhan konsumen. Perubahan fitur tersebut diharapkan dapat menurunkan biaya produksi', 'elektronika_informasi_komunikasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 10:34:32', '2017-09-18 10:35:12', 1),
(31, '2qibzyx3nw', 2017, 1, 269, 0, 'urip28', 'Urip Perwitasari', 'PRODUKSI ENZIM SERBUK GLUKOAMILASE MELALUI FERMENT', 'Glukoamilase (EC 3.2.1.1) merupakan enzim hydrolase yang mendegradasi pati menjadi gula. Glukoamilase menghidrolisis ikatan ?-1,4 dan ikatan ?-1,6 pada pati secara acak. Isolat indigenous dari Indonesia yang diketahui mampu memproduksi glukoamilase adalah Aspergillus awamori KT-11 (Matsubara et al., 2004).  Optimasi produksi glukoamilase dalam fermentasi padat oleh A. awamori KT-11 telah dilakukan (Urip et al., 2017). . Penggunaan limbah kulit singkong sebagai substrat dapat membantu mengurangi jumlah limbah agroindustri. Selain itu enzim ini juga dapat menjadi alternative dalam pemenuhan kebutuhan gula. Oleh sebab itu proses inkubasi perlu dilakukan untuk meningkatkan produksi serbuk enzim glukoamilase.', 'pangan_agroindustri', 1, 300, 75, 3, 2, 0, 0, 1, '2017-09-18 10:36:05', '2017-09-22 18:41:23', 1),
(32, 'iw2i6u424v', 2017, 1, 270, 0, 'dwiantowahyu', 'Wahyu Dwianto', 'PEMBUATAN SEPEDA DENGAN RANGKA KAYU', 'Mengembangkan teknologi pelengkungan kayu dan LVL ini menjadi sepeda dengan rangka kayu, menjadi alat transpotasi ramah lingkungan.', 'material_maju', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 11:21:14', '2017-09-18 11:21:55', 1),
(33, 'wycdv7mceu', 2017, 1, 268, 0, 'monascus', 'Dr. Novik Nurhidayat', 'Produksi Beras Monascus Sebagai Bahan Baku Industr', 'Produk ini merupakan pemanfaatan kapang Monascus purpureus hasil seleksi yang ditumbuhkan pada beras untuk menghasilkan bahan bioaktif potensial diantaranya adalah lovastatin dan Gamma Amino Butyric Acid (GABA), namun aman dari bahan beracun Citrinin. Secara in vivo, ekstrak beras Monascus ini dapat menghambat aktivitas Angiostensin Converting Enzymes (ACE) yang berperan dalam modulasi hipertensi.  Ekstrak ini juga meningkatkan aktivitas interleukin dan efektor lainnya yang berperan dalam respon terhadap infeksi virus Dengue. Dalam kegiatan ini akan dilakukan produksi beras monascus sebagai bahan baku untuk memenuhi kebutuhan industri obat dalam negri.', 'kesehatan_farmasi', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 12:57:48', '2017-09-18 13:16:09', 1),
(34, 'qm08dcbb2u', 2017, 1, 273, 0, 'ferryguswandhi', 'Ferry Guswandhi', 'Pengembangan ATBM (Alat Tenun Bukan Mesin) Menggun', 'Pembuatan ATBM dobby elektronik telah dilakukan dengan menyusun perangkat dobby elektronik dan mendesain ATBM yang disesuaikan dengan perangkat dobby. Penelitian meliputi pembuatan desain ATBM, menyusun perangkat desain elektronik, pembuatan software desain, pembuatan sistem kontrol dobby elektronik, persiapan pertenunan, dan pengujian ATBM (proses tenun). Hasil pengujian ATBM desain elektronik dibandingkan dengan ATBM konvensional dalam hal pembuatan kain tenun menunjukkan bahwa ATBM desain elektronik unggul dalam hal pembuatan desain, mekanisasi proses tenun (pembukaan mulut lusi, peluncuran benang pakan, penguluran benang lusi dan penggulungan kain), dan kemudahan operasional tenun berkat penerapan teknologi elektronik', 'elektronika_informasi_komunikasi', 1, 50, 17, 1, 0, 0, 0, 0, '2017-09-18 13:02:54', '2017-09-18 13:16:09', 1),
(35, 'vrzjx3u6mm', 2017, 1, 20, 0, 'mlutfi321', 'Muhammad Lutfi', 'Pure Natural ,healthy drink asli Indonesia', 'pure natural memproduksi aneka minuman kesehatan asli indonesia ,hingga saat ini sudah ada 7 inovasi produk', 'pangan_agroindustri', 1, 0, 0, 1, 0, 0, 0, 0, '2017-09-18 14:56:29', '2017-09-18 21:01:33', 1),
(36, '9i33w18b4f', 2017, 1, 274, 0, 'suryadi', 'Dr. Bambang Widiyatmoko', 'Pengembangan sensor bencana geologis menjadi proto', 'kegiatan ini diusulkan untuk menjadikan prototype sensor kebencanaan menjadi prototype siap produksi dengan kegiatan utama desain produk, pembuatan contoh produk dan ujicoba lapangan.', 'elektronika_informasi_komunikasi', 1, 200, 50, 2, 0, 0, 0, 0, '2017-09-18 15:57:29', '2017-09-18 16:02:05', 1),
(37, 'uawncbnu93', 2017, 1, 276, 0, 'lisman', 'Dr. Lisman Suryanegara', 'Teknologi Pemanfaatan Limbah Biomassa Untuk Bahan ', 'Bopelet dari ampas kopi dan serbuk kayu telah berhasil diformulasikan dengan menggunakan peralatan yang ada di Puslit Biomaterial. Hasil uji menunjukkan bahwa bioplet tersebut mempunyai nilai kalori 5000 kcal/kg lebih tinggi dibandingkan dengan wood pellet yang beredar dipasaran sekitar 4300 kcal/kg.\r\n    Sejauh ini pasar wood pellet sangat luas baik dalam maupun luar negeri. Pasar dalam negeri telah terindentifikasi pemanfaatan wood pellet sebagai bahan bakar pada home industri (krupuk, tahu, kripik, baso dll), pabrik the sebagai bahan bakar mesin pengering dan pabrik tekstil sebagai bahan bakar boiler.\r\n   Pembiayaan setelah formula dapat terkonfirmasi pada mesin skala pabrik dan kualitas produknya telah lulus uji coba, diharapkan ada investor yang mau membiayai pembangunan pabrik full scale.\r\n   SDM merupakan gabungan dari Puslit Biomaterial, Pusat Inovasi dan Mitra.\r\n   Skema alih teknologi melalui lisensi yang akan difasilitasi oleh Pusinov.', 'material_maju', 1, 400, 100, 3, 2, 0, 0, 1, '2017-09-18 19:25:14', '2017-09-20 11:36:55', 1),
(38, 'p6ea5cksu2', 2017, 1, 209, 0, 'annisakusumaningrum', 'Annisa Kusumaningrum', 'INOVASI KEMASAN JENANG KETAN DI UKM KELOMPOK JENAN', 'Menerapkan teknologi pengemasan makanan khususnya untuk pengembangan kemasan jenang ketan khas Kecamatan Rongkop Kabupaten Gunungkidul  yang lebih menarik dan aye catching sebagai salah satu oleh-oleh khas', 'pangan_agroindustri', 1, 260, 65, 4, 2, 0, 0, 0, '2017-09-18 21:23:28', '2017-09-22 18:33:41', 1);
